INSERT INTO `forum_answer` VALUES (1,0,7,0,'<p class=\"MsoNormal\">Corelogs.com is a website that has been designed for the\r\npeople relating to the core segment of engineering. There have been a lot of\r\nwebsites in Social Networking segment, coder’s community and other websites\r\nthat have been helping people free of cost. But the core segment, especially\r\nthe SMEs are long neglected and almost untouched by the web2.0 revolution. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">So, we are trying to get the whole Core segment, from the\r\nIndustrialists and people of SMEs in the manufacturing and the consultancy\r\nsegment to the engineers working in the Large Scale Industries along with the\r\ncollege students who are part of the Teams building Formula &amp; BAJA cars and\r\nairplanes. We are here to create a collaborative community among these people\r\nwho can benefit from each other and thus help the flow of knowledge, best\r\npractices and information. All this is actually meant for the core segment but\r\nthe people at the center of the focus are the SMEs who are manufacturing\r\ncomponents for the large scale industries. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">For the SMEs it is going to be a boon. SMEs today are\r\nexploited when it comes to the internet world. They are charged high prices for\r\nmaking a simple website for them and then for maintaining it. They are charged\r\nfor listing their products and services on the internet thus keeping them away\r\nfor the opportunities. When they face a problem or a technical issue, most of\r\nthem can’t go to the consultancies as they charge far too much. We are creating\r\nan environment in parlance with Government of India’s Make In India plan to\r\nmake the SMEs independent through creating a community where they can solve\r\ntheir problems. This would be a localized network of industries and SMEs where\r\nthey can promote themselves seek help from the more learned ones and connect\r\nwith the Large Scale Industries and the engineers. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Now, for the teams making cars and aero planes, we are\r\nsolving a similar set of problems. These people need a place to interact so\r\nthat they can discuss things, ask questions, get answers and suggestions. Also,\r\nthey are upcoming engineers, and we are trying to direct them to help the\r\nindustries and SMEs through whatever knowledge they have.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">We are here with all good motives to be helpful and create\r\nvalue for all these people.&nbsp;<o:p></o:p></p>','2015-06-13 19:35:45',0,1,'20:42:24',1,1,1),(2,0,1,0,'I would like to answer this question. There are a variety of misconceptions about Lean manufacturing. Basically, people get to know about it through a story or reports showing the details of Lean implementation in some Industry. It’s here where all the problems start. Without getting into the depths of the approach, they conclude that this strategy is not going to work in their industry or that the way we operate and kind of work we do can’t really go without inventory or the kind of orders we handle, it is impossible to reduce the lead time and blabla…. This way they finalize that the investment is not worth it.&nbsp;What they basically don’t understand is that Lean is not a strategy, it is not some step-by-step guide to increase productivity. Basically, Lean is a way of thinking. It’s important to understand that it can be implemented anywhere and there is no limit to it. Comparing it with the Indian concept of “Jugaad”, if somebody not belonging to India hears a story of implementation of “jugaad” in some industry, he might think that this can’t be done anywhere else or not at least in his industry. But then an Indian knows that “jugaad” can be applied anywhere whatever the process or the industry may be. Some say that the whole country is running on “jugaad”. The same with Lean, it can be implemented anywhere in some way or other.To implement Lean manufacturing, the only thing you have to do is understand the philosophy in it – “continuous improvement through removal of wastes”. As far as an SME is concerned Lean can be implemented, but it needs proper shift of mindset of everybody involved, from the worker and the foreman to the senior management level. It is not as simple as enforcing some rules or training the workers. It is something like the shift of the mindset.To implement it, a SME has to first do the value stream mapping. It is basically a simple thing where somebody maps the current state of the manufacturing process. In simple words, one has to measure the distribution of timing and value addition at each stage of processing thus generate an overview as to what amount of time is value adding and for how much time it is remaining idle as an in process inventory. Then a future state (ideal) map is generated by removing all the time wasted in waiting and all non-value added activities from it. After that you have to work for realizing the changes through using the methods used in lean manufacturing or devising new ways for your purpose. Measuring the improvement and repeating the cycle is the way to continuous improvement.Now finally, all these things and improvements don’t mean nothing if you don’t train your workforce and involve them. If all the changes in methodologies are passed to the workers as orders, you are not going to see any long lasting effect. The improvements must be devised in collaboration of the workers who are actually getting their hands dirty in the manufacturing. Also, you need to understand that Lean is not about following some rules and methods having those Japanese names. Rather it is a simple concept that anybody can work in his own way. It’s just that the Japanese have worked too much on it and have matured it to the level that would take you decades to reach near them. That’s why it’s better to follow them when it comes to lean manufacturing.\r\n			    ','2015-06-21 13:26:55',0,1,'19:24:05',1,2,2),(3,0,2,0,'TCS EIS is actually providing support to large and small industries in the core segment over the world. It has the most prestigious brands in manufacturing segment as its clients. Few examples are GE (General Electric), Rolls Royce, Applied Materials, Ferrari and so on. Most of the work in EIS segment is related to implementation of PLM in large industries and customize the existing products in the market according to their needs, adding functionalities etc. Other than PLM, it also aids in the new product development to many companies in the Medical devices, automobile, aerospace and other segments and has got multiple patents in its name.They are also in the field of Design and analysis, CFD simulation, meshing and other jobs for various companies.It is also helping the industries during mergers in terms of data handling and adapting to the change of platform. When one company acquires other company, it helps in migration of product data from one platform to another. Other than these, the EIS segment is helping large scale industries in documenting things, creation and maintenance of shared knowledge and automation of repetitive jobs.\r\n			    ','2015-06-21 15:34:26',0,1,'00:30:31',1,4,10),(4,0,3,0,'What problems do organizations face\r\nduring the implementation of changes in their product designs and how do they\r\ncontrol them?\r\n\r\nFor answering this question, I\r\nwill take some assumptions:\r\n\r\n1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The\r\norganization in question has a diverse product range.2. The\r\norganization in question is sufficiently large such that engineering changes\r\ncannot be easily implemented by word of mouth.\r\n\r\n3.&nbsp; &nbsp; &nbsp; &nbsp;For\r\nthe organization in question, achieving high quality is of utmost concern.\r\n\r\n4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The\r\ncutoff date/cutoff batch/cutoff machine for design change is extremely\r\nimportant.&nbsp;5. The\r\nproduct manufacturing lead time is sufficiently large to effect long spares/raw\r\nmaterial inventory.\r\n\r\nAny mid-large scale manufacturing\r\nindustry is always in constant state of self-improvement for its survival. Self-improvements\r\nmight directly refer to value engineering (design changes, raw material wastage\r\nreduction, process improvements, quality improvements etc.) or to introduction\r\nof a new design all together. \r\n\r\nIn our case, we are more\r\nconcerned about the design changes which a company wants to implement. For an\r\nindustry with a diverse range of products having large production quantities,\r\nsuch changes can be particularly difficult to implement.&nbsp; A few of the major problems include:\r\n\r\n1.&nbsp; &nbsp; .Inability\r\nof the organization to supply new drawings and remove old ones from all the\r\nworkstations in its workshops.\r\n\r\n2.&nbsp; Inability\r\nof the organization to supply new drawings and remove old ones to all the concerned\r\nvendors.\r\n\r\n3.&nbsp;&nbsp;&nbsp;Inability\r\nof the organization to modify the designated standard production process according\r\nto change in the design.\r\n\r\n4.&nbsp;&nbsp;&nbsp;Inadequate\r\ntraining of the workforce to identify changes in the drawings.\r\n\r\n5.&nbsp;&nbsp;&nbsp;Inability\r\nof the organization to modify existing/manufacture new process aids\r\n(jigs/fixtures) to help implement the design changes.\r\n\r\nThe above problems can be solved\r\nby using a very flexible design change cycle. The cycle starts by the design\r\ndepartment requesting the desired changes in any existing part. These changes\r\nare then passed on to the process engineering and development group. This group\r\nhas representatives/experts from each core competence field of the company (Eg.\r\nMachining, Fabrication, Painting etc.). The design changes are then rigorously\r\nchecked for their feasibility and manufacturing ease. The decision to manufacture\r\nthe component in house or offload it to a vendor is taken by this group. If the\r\nproduct is to be manufactured in house, the group triggers the action by first\r\ninformation all the concerned shops (machining, fabrication etc.). Any change\r\nin the existing production aids design is reviewed as a priority. A review is\r\nconducted to check the cost of implantation of a design change w.r.t the\r\nimportance/criticality of its implantation. All old drawings are collected and\r\ndestroyed by the process engineering group. New drawings are issued with\r\nadequate control instructions. &nbsp;If any\r\nalteration needs to be done in the production process, then a process sheet is\r\nreleased (with adequate control instructions) detailing the minute details of\r\nthe standard production process to be adopted. The Quality Assurance department\r\nis tasked with updating the cutoff date/cutoff batch/cutoff machine in which the\r\ndesign change has been implemented. This is done to ensure that the spares\r\nmanual is updated. In case the parts are made by vendors then similar process\r\nis adopted by the vendor support group of the process engineering group.\r\nDespite adequate checks in place, no system/process is full proof as human\r\nerror always comes into play. Thus, sometimes non implementation of design\r\nchanges can result in creation of unsafe conditions, reduction in quality, high\r\nrework costs etc.\r\n			    ','2015-06-21 18:30:02',0,1,'00:19:56',1,6,27),(5,0,4,0,'It is well\r\nknown that the aerospace industry needs to follow a much higher quality\r\nstandard when it comes to manufacturing components of the aircraft and space\r\nshuttles. When it comes to ISRO’s missions like MOM etc, it becomes even more\r\nimportant. In the aerospace industry, it is widely accepted that the\r\nmanufacturing quality of indian original eqipments manufacturers are not upto\r\nthe mark and simply declare them unfit for usage. Aerospace giants like UTC\r\naerospace systems, GE, Rolls-Royce etc. try to play safe when it comes to\r\ncritical parts. \r\n\r\nISRO has been\r\nfollowing a Zero-defect delivery programme, initiated in 2012 by its chairman.\r\nThey have tried to implement it in a ground-up fashion and they have involved\r\nthe technicians, the technical assistants and engineers to the top most levels.\r\nDirectorate of Systems Reliability &amp; Quality (DSRQ) acts as a nodal agency\r\nand extends technical advices and support to ISRO and helps them in maintaining\r\nthe required quality standards for its mission critical components. Few\r\nstandards are defined and each process has to go through them to be given a\r\ngreen signal.\r\n\r\n1.&nbsp; &nbsp; &nbsp; 1. &nbsp;Reliability\r\nmanagement practices: Under this, they focus on reviews at different\r\nstages(conceptual to post-flight)\r\n\r\n2.&nbsp; &nbsp; &nbsp; &nbsp;2.&nbsp;Parts\r\nand material monitoring: wide range of tests is carried and the materials are\r\nstored under controlled environment. Special consideration is given to\r\nenvironmental impacts of materials and chemicals being used.\r\n\r\n3.&nbsp; &nbsp; &nbsp; 3. &nbsp;Software\r\nQuality standards are strictly followed.\r\n\r\nBut what\r\nhappens to the parts that have been outsourced to the vendors in the local\r\nindustrial areas? ISRO, as an organization has worked to help its vendors\r\nstandardize the processes. Also, the scientists from ISRO remain in constant\r\ntouch with the vendors during the design development and manufacturing of the\r\ncomponents hand share the technologies, the best practices and guide them in\r\norder to guarantee the required quality. After working for ISRO for different\r\nprojects many of these SMEs have evolved in such a great way that they have turned\r\ninto exporters and are being respected world-wide for their products.\r\n\r\nThus, focusing\r\non maintaining global quality standards, along with the need to spend less thus\r\ndeveloping indigenous technologies and Indian SMEs as partners and consistently\r\nhelping them to improve their technologies has helped ISRO maintain its quality\r\nstandards. More details can be found at&nbsp;<a href=\"It is well known that the aerospace industry needs to follow a much higher quality standard when it comes to manufacturing components of the aircraft and space shuttles. When it comes to ISRO’s missions like MOM etc, it becomes even more important. In the aerospace industry, it is widely accepted that the manufacturing quality of indian original eqipments manufacturers are not upto the mark and simply declare them unfit for usage. Aerospace giants like UTC aerospace systems, GE, Rolls-Royce etc. try to play safe when it comes to critical parts.  ISRO has been following a Zero-defect delivery programme, initiated in 2012 by its chairman. They have tried to implement it in a ground-up fashion and they have involved the technicians, the technical assistants and engineers to the top most levels. Directorate of Systems Reliability &amp; Quality (DSRQ) acts as a nodal agency and extends technical advices and support to ISRO and helps them in maintaining the required quality standards for its mission critical components. Few standards are defined and each process has to go through them to be given a green signal. 1.	Reliability management practices: Under this, they focus on reviews at different stages(conceptual to post-flight) 2.	Parts and material monitoring: wide range of tests is carried and the materials are stored under controlled environment. Special consideration is given to environmental impacts of materials and chemicals being used. 3.	Software Quality standards are strictly followed. But what happens to the parts that have been outsourced to the vendors in the local industrial areas? ISRO, as an organization has worked to help its vendors standardize the processes. Also, the scientists from ISRO remain in constant touch with the vendors during the design development and manufacturing of the components hand share the technologies, the best practices and guide them in order to guarantee the required quality. After working for ISRO for different projects many of these SMEs have evolved in such a great way that they have turned into exporters and are being respected world-wide for their products. Thus, focusing on maintaining global quality standards, along with the need to spend less thus developing indigenous technologies and Indian SMEs as partners and consistently helping them to improve their technologies has helped ISRO maintain its quality standards. More details can be found at http://www.sac.gov.in/SACSITE/TTIDWebsite/publication/media/article/Quality_Mgmt_%20ISRO_Experience.pdf \">this link</a>\r\n			    ','2015-06-22 16:39:32',0,1,'14:22:59',1,3,15),(6,1,3,0,'Product\r\nLifecycle Management is one of the new (not so new) technologies the\r\nmanufacturing world is using. Basically it is management of products from its\r\nconception, all the way through design, manufacturing distribution to the\r\ndisposal. In simple terms it is a system which manages the data and workflows\r\nrelated to the product’s lifecycle. There are many softwares that specialize at\r\nthis task. A few examples are ENOVIA, Teamcenter, Windchill etc. one of the\r\nmost important jobs a PLM software has to handle is handling the CAD data of\r\nthe products. Basically there are many CAD tools available which are being used\r\nfor modelling and simulation of the products. CATIA, Unigraphics, ProE,\r\nSoliworks are a few well known examples.&nbsp;<br><u>SO what happens when different groups\r\nwithin the same company, working on the same product use different CAD\r\npackages? Or even worse, a company working on ProE acquires another company\r\nworking on CATIA or NX? &nbsp;Chaos?</u> Since the\r\ndata or the CAD models are not compatible to each other, we need to use some\r\nkind of tool for integration of both types of data, basically a platform which\r\ncan handle both cad packages along with&nbsp;\r\ndoing multiple other tasks. So, one of the basic task of a PLM system is\r\nto handle data from different CAD packages. But now, how does a PLM software\r\nmanages the lifecycle of a product?&nbsp;<br>Let’s suppose that 10 people are working on\r\nthe wheel assembly of a car which is presently under design phase. Another 10\r\npeople at some other location are working on the chassis and another few on the\r\nvendor relationship and purchase department of the company for the same car and\r\nso on. So, they need a system where they can manage all the data they keep on generating\r\neveryday so that each team can be in sync with each other. The designer of the\r\nchassis needs the design of the wheel assembly and the powertrain as well so as\r\nto manage the compatibility of different parts. Similarly, the purchase\r\ndepartment needs the data from all the teams. Now, once the initial design is\r\nfinalized, somebody from the chassis team feels the need to change the design a\r\nlittle. Now in this case, lack of a common platform may lead to disasters at\r\nthe time of assembly.&nbsp;<br>With a PLM system what happens is as the chassis design\r\nis updated, a design revision is created for that item and for that, a workflow\r\nis initiated to be approved by various people as the requirement of the project\r\nsuggests. Thus, any small change in design can be circulated among the team\r\neasily thus maintaining the integrity of the design. The Drawings of the CAD\r\nmodels are attached with the models and are updated along with the change in\r\nmodel in real time. Thus any change is easily noticed by the purchase department\r\nwhich can be sure at any time that it is dealing with the most updated designs\r\nand drawings. Now once the design is finalized and the parts are being\r\nmanufactured by different vendors, the quantity of components to be\r\nmanufactured and the delivery dates can easily be maintained using the PLM\r\nsoftware.<br>&nbsp;These are but a\r\nfew usage of PLM software and just an introduction of implementation of PLM in\r\nindustries. PLM is being used for multiple purposes and is a consistently\r\ndeveloping field. Siemens, Dassault Systems and many other companies are\r\ninvesting too much in this field and this field has a lot more to traverse.\r\n			    ','2015-06-23 16:20:53',0,1,'10:43:31',1,8,1),(7,0,1,0,'Amara Raja has actually made quite good progress in the last few years in the automotive as well as industrial segment of battery sales. The share prices and the market share of Amara raja is constantly going uphill whereas that of exide industries are lagging behind. Even though Exide is not showing a downhill trend, the growth rate of amara raja is constantly more than Exide since last few years.<br>However Exide owns more than 65% market share in automotive OEM and organized retail, amara raja is fast catching up exide industries. But this is a little misleading as the profits of amara raja are on the downside which means they are expanding on the price of cost which won\'t be sustainable for long.<br><i>From an investor\'s point of view, investing in Amara raja for short period can be more profitable than investing in exide.</i>','2015-06-25 09:21:20',0,1,'00:45:01',1,7,1),(8,0,2,0,'Amaron is Joint venture of Amara Raja batteries and Jhonson controls Inc., which is also world leader in Automotive batteries. Amaron used technology of Jhonson controls and &nbsp;has produced a very good quality product in Indian market. Amaron has hit the market with long life batteries marketed as zero maintenance battery. It is also OEM of many automobile company.It has a considerably big industrial battery business, with supplies to the Department of Telecommunications, the Indian Railways, etc.&nbsp;\r\n			    ','2015-06-25 11:47:14',0,1,'00:51:18',1,7,38),(9,1,4,0,'Amaron, no doubt, is doing good and it is trying to grab a bite of the Exide\'s share. However, it has a long way to go and will certainly take a continuous effort from the Amara Raja group before it poses a real threat to Exide.&nbsp;Lets start with the production capacity first. Exide has seven factories, compared to only 1 of Amara Raja, spread across India giving it a huge advantage not only in terms of quantity, but also strategically. Due to its pan India presence, Exide can supply the batteries to the customers at a very short notice, meanwhile cutting down the inventory and transportation costs.The range of product exide has - starting from motorcycle batteries to submarine batteries is unmatched. Only Exide can boast of such variety in its repertoire.Technologically, both are comparable, because after all Lead Acid is a very primitive technology and the basic elements cannot be tampered with.&nbsp;Coming to the after sales service, due to Exide\'s extensive dealership network, the ease of service is certainly higher. The main reason for Amaron doing good is because of the facility of a line of credit to its retailers - Exide is fully Cash and Carry.<br>There is still a long way for to go for Amara Raja......<br>','2015-06-25 18:33:32',0,1,'12:37:08',1,7,29),(10,0,2,0,'Indian defense industry has grown substantially in recent year and it will have more good days ahead.There are several PSU which are doing the manufacturing. For example HAL has manufactured HAL Tejas ingeniously. Helicopter like HAL Rudra, Dhruv ,Chetak &nbsp;cheetah are also developed by HAL. HAL also manufacture Russian Sukhoi Su-30 on transfer of Technology basis. Missile like Agni, Prithvi, Naag, Submarine like INS Arihant , Aircraft Career Vikrant are being Developed by India. PSUs like DRDO, BEL, Ordinance factory have been  full filling military requirement of India. Defense industries in India is heavily leaned toward PSUs. But in recent year Private player like BAE,Boeing, Dassault, L&amp;T,Mahindra Tata have shown interest in Defense Sector. In Fact Tata, Mahindra, Nissan etc are involved in manufacturing of Combat vehicle in JV with PSUs. Talking about Future of Defense industries in India. I think this can be one of leading sector in Indian Economy, because of following reasons-<br>&nbsp;<b>Military Expenditure:&nbsp;</b>Currently India is world number seven in military Expenditure. and it is expected that it will be Number third in next &nbsp; &nbsp; 20 years. Currently major portion of Expenditure goes in Foreign deal. Indian Government Surely want to Maximize &nbsp;its Inventory by Developing in India<br><b>Geographical Location:&nbsp;</b>India has neighbor like China and Pakistan, with which whom it has bitter past. It always need its Army and &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Air force on there feet ready for combat. Further Mumbai attacks and Increasing intervention of China in Indian ocean has made it more important for India to Guard &nbsp;long Coastal boundary.<br><b>Defense&nbsp;Procurement Procedure (DPP) :&nbsp;</b>DPP lays down rule of Procurement of Defense Supply. Recent Changes in DPP in 2002 and &nbsp; &nbsp; &nbsp; &nbsp;2012 promotes Indigenous manufacturing of defense equipment.&nbsp;<b>&nbsp;</b><b><br></b><b>Shortage of inventory:&nbsp;</b>&nbsp;Beside of large number of deals in Recent years India still have Outdated Sukhoi and MIG Aircraft in its fleet. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Reason behind this is it takes long time in procurement. India cannot depend solely upon Foreign Player for &nbsp;Warheads.<br><b>Market and Work Force: &nbsp;</b>As explained above India is a Big market for Military equipment, therefore big global player are interested in &nbsp; &nbsp; &nbsp; &nbsp; investing in Indian Defense sector. India has large workforce to support these industries. Like automobile sector there can be lot of SMEs supporting Big Industries.<br><b>Government Interest:&nbsp;</b>&nbsp;Indian Government knows important of strong defense. And has shown positive mood for defense industries in &nbsp;India.&nbsp;&nbsp;Make in India campaign &nbsp;is also pushing for manufacturing in India.&nbsp;&nbsp;','2015-06-26 04:12:16',0,1,'05:56:54',1,9,38),(11,0,1,0,'Jamshedpur is\r\none of the oldest indian industrial cities. It is having one of the largest\r\nsteel plant and one of the oldest automobile plants of india. It has this\r\nadityapur industrial area as one of the oldest industrial areas of the country.\r\nBut this industrial area has been left behind in the race of development. The\r\nindustrial area is almost decadent and has lost the pace of development.\r\nEarlier the city was having 1000 SMEs out of which 30-40% have been shut down\r\nin recent years. But what is the reason for all this.&nbsp;<br>&nbsp;One of the most\r\nimportant reason for this has been the incompetent state-government which has\r\nfailed to attract any investment to the area or offering other industrial\r\ngiants to setup their plants into the area. Another reason is the control of\r\nTATA over the industrial area. Because of that, no other automobile industry\r\nhas dared to establish a plant nearby. So most of the SMEs of the industrial\r\nareas are the ancillaries of Tata Motors and they are almost dependent on Tata\r\nmotors in one way or other.&nbsp;<br>So now, when the production of Tata Motors,\r\nJamshedpur plant dips, many small scale industries are forced out of the\r\nbusiness. The heavy cost cutting going on in TM since last few years has also\r\nput extreme pressure on the SMEs causing many of them to close their\r\nbusinesses.&nbsp;\r\n\r\n<br>Other than\r\nthese simple reasons, the lack of competition among the SMEs in this area for a\r\nlong period of time has forced them out of the competition. The area remained\r\nstagnant in terms of &nbsp;as they were\r\ngetting continuous orders from the TM plant and quality requirements were not\r\nvery critical at that time. These SMEs did not invest in technology upgradation\r\nand methodology improvement during that period. Most of the business was closed\r\ndoor and except TM, there was no other player which they could supply to.&nbsp;<br>&nbsp;In these\r\nconditions, these SMEs became defensive so that no other SME could take\r\nwhatever business they had have. This resulted in reduction of collaborative\r\ndevelopment of the industrial area through technology sharing. So when the\r\nworld became better connected, other suppliers from other industrial area\r\nstarted to overtake their market share. Also lack of consultancy and support\r\nfor SMEs by the government has catalyzed the degradation.\r\n			    ','2015-06-26 17:38:48',0,1,'11:32:20',1,10,2),(12,1,1,0,'<b>Plain Stress</b> is the case when stress act only at two direction say x and y axis. Stress in z direction is z direction is negligible as compare to stress in x and y direction.<br><b>Plain Strain</b> is the case when one of the principal strain is negligible. We can consider a sheet of metal whose thickness is constrained then it is a plain strain situation.','2015-06-28 17:27:15',0,1,'00:41:58',1,13,22),(13,1,1,0,'Refer this video....<br><a href=\"http://www.youtube.com/watch?v=WlFs2unBvdU\">http://www.youtube.com/watch?v=WlFs2unBvdU</a>','2015-06-28 17:27:18',0,1,'00:41:59',1,13,22),(14,0,3,0,'<b>Auxetics</b>&nbsp;are&nbsp;<a href=\"https://en.wikipedia.org/wiki/Chemical_substance\" title=\"Chemical substance\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">materials</a>&nbsp;have a negative&nbsp;<a href=\"https://en.wikipedia.org/wiki/Poisson%27s_ratio\" title=\"Poisson\'s ratio\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Poisson\'s ratio</a>. When stretched, they become thicker perpendicular to the applied force. This occurs due to their hinge-like structures, which flex when stretched. Auxetic materials can be single&nbsp;<a href=\"https://en.wikipedia.org/wiki/Molecule\" title=\"Molecule\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">molecules</a>&nbsp;or a particular structure of macroscopic matter. Such materials are expected to have mechanical properties such as high&nbsp;<a href=\"https://en.wikipedia.org/wiki/Shock_absorber\" title=\"Shock absorber\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">energy absorption</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fracture\" title=\"Fracture\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">fracture</a>&nbsp;resistance.&nbsp;Auxetics may be useful in applications such as&nbsp;<a href=\"https://en.wikipedia.org/wiki/Ballistic_vest\" title=\"Ballistic vest\" class=\"mw-redirect\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">body armor</a>,&nbsp;packing material, knee and elbow pads, robust shock absorbing material, and sponge mops.<br>\r\n			    <br>Source-&nbsp;<a href=\"https://en.wikipedia.org/wiki/Auxetics\">https://en.wikipedia.org/wiki/Auxetics</a>','2015-06-28 17:35:53',0,1,'15:03:55',1,12,22),(15,0,3,0,'It is quite a broad question and can\'t be answered definitively. However, based on my experience I will try to explain.<br><br>The baja vehicle uses the single cylinder Briggs &amp; Stratton Engine which is a very primitive engine with minimal balancing and all that makes it vibrate too much as you might have seen as compared to the single cylinder engine of motorcycles. Also, In a Baja vehicle, Engine alone contains the major share of the weight onlyafter the driver and the roll-cage.<br>So, let\'s take it this way. You take a baja vehicle, remove the dampers from the suspension so that the suspension contains only springs and then start the engine. Now if the vibration frequency of the engine which you can calculate by the rpm of the engine and that of the vehicle come in resonance then you can expect tragedy. So, do it such that these two things never fall in resonance. Plus the dampers in the suspension, you are safe.<br>Now, The mounting of the engine must be stiff and strong and very strongly attached to the Chassis or the roll-cage. Many teams use aluminium blocks &amp; nylon blocks to mount thr engine on the roll-cage which is quite good. You should not use bushing if you are using CVT because that would introduce unnecessary play and thus big problems to CVT belts that would wear out fastly. Also, the quality of bushings is not reliable until it is original. Any other local bushing would tear apart if the vehicle ever topples. If you are using custom frames to mount the engine, be sure to make it strong and the section must have very high bending strength which you can achieve with parallel plates as in the figure.&nbsp;<br>Considering the configuration, the axis of engine cylinder is tilted at about 30 degrees to the vertical. so if you mount the engine so that the cylinder tilts towards the RRH, then you can reduce the vibration a little bit but it counts only if the weight of the vehicle is low. In the pic shown, during the event the engine mounting parallel plate 1.5 mm thick sheared when the car toppled on the downhill(it was so fast that it toppled to upside down position), but even then the bending strength was so much that the vehicle worked fine only with little extra vibration.<br>As the conclusion, for a baja vehicle, if you are mounting the engine at its base only, you should reduce the vibration allowed as much as you can.','2015-06-30 16:25:36',0,1,'13:26:56',1,16,2),(16,0,2,0,'Water rise in capillary due to surface tension. It will not be possible to throw water in a capillary tube &nbsp;out through a opening. Water can only be thrown out only if adhesive force of water and outlet tube will be more than than that of water and capillary tube. In that case too water will never fall of outlet tube. It will be sticking in with tube surface and water will never acquire kinetic energy to produce any useful work.<br>This is only my point of view. Please correct me if I am wrong.','2015-06-30 17:37:06',0,1,'13:21:29',1,17,38),(17,0,1,0,'The answer give by Ritesh is the right answer. Its only the intermolecular forces that pull the water upwards. the thicker the section the less the rise because it can apply that much force only. Also unless the force is balanced, the water cannot remain in eqillibrium so u can\'t throw the water out anyway from side opening.','2015-06-30 20:04:16',0,1,'15:27:49',1,17,79),(18,0,0,0,'As answered by Rohit Mounting are subjected to very high Bending load. your base for engine must have &nbsp;strong section.In addition to that Mounting suffer cyclic load. Generally No. of cycle in a baja competition is comparatively less but I have Read in Discussions that some team have faced Fatigue Failure. So make sure You use material with good fatigue strength. For Aluminium 7050 Grade is good. &nbsp;\r\n			    ','2015-07-01 14:11:51',0,1,'19:42:37',1,16,22),(19,0,2,0,'\"Designed to Dream, Driven to Deliver\" With Mahindra\'s performance in all its previous ventures. It seems to me as the next big thing in the Indian Aerospace industry. &nbsp;With the few arrows in Mahindra\'s quiver in the past few months it seems propelling towards becoming a major players to the Indian Aerospace industry.The MoU with GE Aviation for Aerostuctures design and Manufacture, the partnership with Magellan aerospace to manufacture structural assemblies and parts, and the deal with Airbus subsidiary Premium AeroTec to provide many components for Airbus aircrafts seem to establish Mahindra in the global aerospace industry.&nbsp;Mahindra is already having a state of art Aerostructure manufacturing plant in Karnataka equipped with Sheet metal capabilities and a special chemical process plants. All of these are certified to global OEM standards and the special process plants are NadCap approved. They are already planning to open a new facility for airframe assembly as well.&nbsp;Mahindra has acquired a major stake in Gippsland Aeronautics which is manufactring the Airvan Propeller aircraft and Aerostaff which is a high precision component manufacturer.&nbsp;Considering the high quality requirements and stringent certification procedures, it may take time for Mahindra to bring full aircraft manufacture and assembly to India very soon. But the future has begun. And I\'m positive about seeing an Airvan flying out of an Indian assembly plant in future.&nbsp;<br>\r\n			    ','2015-07-02 06:26:40',0,1,'12:39:25',1,14,15),(20,0,1,0,'Over &nbsp;steering Geometry is perfectly fine for a Baja ATV considering the rugged tracks with low grip of tyres on the track. It actually is all dependent upon the driver. If he practices with an ATV with oversteering characteristics, and he gets comfortable with it, a little oversteering property is no harm. As for the roll axis inclination, if you incline the roll axis backwards, there can be certain advantages and disadvantages.<br>If the roll center at front is higher and that at the rear is lower, the overall weight transfer remains the same but the distribution of weight changes. Considering your case, if the roll axis is inclined towards the rear, the weight transfer in the rear part of the vehicle will be larger than that at the front part. So if this is the case you will get different properties at turn entry and turn exit. On turn entry, you are in decelerating condition so the weight is already shifted on the front tyres. Now if the roll axis is inclined towards the rear, the weight at turn entry will be more evenly distributed among front and rear outer wheels which will lead to better behaviour and less slip at turn entry. This will get you better cornering forces.<br>Now, When at turn exit, you are in accelerating condition, so at this point the maximum weight will shift to rear outer wheels. So the rear tyre will see more slip, this will cause your vehicle to oversteer which is perfectly fine if the driver has done enough practice on the vehicle as this will help you in sharp corners. Also, when using differentials, there is going to be no major problem. If you are using chain sprocket in rear wheels without differential, it may cause little powerloss due to increased slip at turn exits.<br>However, from my experience, I will say that these things do not matter too much when compared to the build of the vehicle. These things might gain you a few seconds per laps so it counts only when all the other things are working perfectly fine. So, if the inclination is not very high, you will not see much difference in the behaviour of your Baja ATV.','2015-07-03 04:59:07',0,1,'11:20:27',1,23,1),(21,0,0,0,'Giving a definitive answer to this question is next to impossible. But considering that you have a vehicle of 250 kgs with driver and its a Baja vehicle, this is a general scenario and you can go with what most of the teams do. The way I see it, you should not worry too much about it as changing camber by a few degrees wont affect the performance of your vehicle if you have got a regular Baja tyre with circular cross section. Also, in the normal conditions prevalent &nbsp;in the workshop, you cant measure it with that perfection.<br>Let\'s start it with the steady state condition. It is better to have a negative camber at the front wheel and that should not be too much. So to be safe, it should be around -5 degrees. Now, let\'s consider the camber changes in roll and cornering. If you are following a normal double-A arm suspension with around 14\"-15\" of arm length, on a roll of 7-8 degrees, you will get a little camber gain on the outer front wheel. This means that the amount of negative camber will get reduced but even then it should remain a little negative as that provides better cornering force.<br>So this makes a good geometry. Let\'s also consider the the KPI and Caster which would help you change the camber when in turn to a little more negative and that is a benefit.&nbsp;<br>In the rear wheels, again you should go with the normal trend. A little negative camber. But if you have wide tyres with rectangular contact patch, you can go with zero camber. Also, the camber change here is purely dependent upon the suspension type you are using. If it is Trailing arm, you are in problem. If it is Double wishbone, it is good in terms of camber changes. However multi link suspension might be the best to go with as it may provide you camber changes similar to double wishbone but will give you space as the trailing link.<br>So basically it\'s all normal geometry. The only thing you have to keep in mind is that the little negative camber in wheels during turn will get you better cornering forces. So you should finalize all on this on one basis that after roll camber change, camber change due to steering geometry and the default camber should add up to give you around -3 to -5 degree of camber at turns.','2015-07-04 17:52:40',0,1,'23:22:40',1,19,1),(22,0,3,0,'&nbsp; Seamless and welded pipe does not have any difference as &nbsp;far as your requirement is considered from a practical standpoint . Welded pipes are cheaper than seamless pipe. Seamless pipe have better tolerance and Corrosion resistance. But strength of pipes are almost same. It is advisable to use welded pipe. There may be quality issue with means of welding used or purity of steel used for manufacturing welded pipe. Do test your pipe in laboratory before using it. I have experienced cases in which manufacturer dont use specified composition of steel for manufacturing.&nbsp;','2015-07-05 15:12:02',0,1,'23:59:56',1,24,116),(23,0,3,0,'First, It is tube, not pipe.<br>I would suggest you to go with seamless pipe if possible. As far as theoretical strength is considered, both are same. But when you closely observe the welded pipes from a local manufacturer, you will see that the welding is actually not that good, the fusion is improper. In these cases, the tubes will behave very different from expected under bending and compression. However if you are having enough factor od=f safety, you can go with welded tubes too.','2015-07-06 04:26:37',0,1,'23:59:53',1,24,1),(24,1,2,0,'Internet of Things or Industrial internet has these days became a very common term. It can be explained as a system which uses real time data analytics and makes a comparison with existing data and the patterns so as to reach a conclusion. It is being used in various areas from home applications to heavy engineering and for controlling flight timings to predicting when your refrigerator needs to be refilled with eggs or vegetables.<br>In the core segment it is mostly being used for predictive analysis. General Electric is one of the first companies that is developing this idea of Industrial internet of things. The steam turbines and Engines it is manufacturing these days is fitted with hundred of sensors which keep on measuring the temperature, vibrations, compliance, friction, rpm and a lot of other things. These sensors continuously transmits the data to the computers situated at remote locations through internet. Then those computers keep on analyzing the data in real time and keep on comaring the readings wit existing data and look for any abnormality so as to predict any failure before it actually happens. This gives them a big advantage as they can control the operations in real time with the use of many actuators so that there is no need for breakdown maintenance.<br>As the above illustration suggests, IoT can be used in the core segment quite effectively. In large manufacturing plants, we can apply it on the machinery used for manufacturing for reducing down time and enhance performance. It can be used to keep a better control over the quality of parts being manufactured by collecting suitable data. In the production line, lot of time can be saved by doing a real time analysis of the operations going on in the line. Along with these things, the normal maintenance work can also be one with IoT.<br>As an extra information, you can look into <a href=\"https://www.gesoftware.com/predix\">Predix</a>, a platform by GE launched very recently as an open sourced project. It can be used by the core segment.','2015-07-06 05:32:57',0,1,'11:28:08',1,20,1),(25,0,3,0,'Predix is an industrial internet software created and used by GE. Last year GE opened it for other industries so that they can use it to speed up the development of industrial internet apps. So basically Predix is a platform on the top of which you can develop industrial internet apps specific to the needs of your industry and machinery.<br>For example, if you have a turbine which needs to undergo maintenance operations on a scheduled basis. If you do not do proper maintenance, it may lead to failures and breakdowns. But maintenance also involves cost, down time, wear and tear etc. The Industrial Internet is the solution which enables the concept of predictive maintenance of the machinery which actually relies upon the real time data analytics of the data from various sensors in the turbine.<br><br>Let us discuss it in more detail. In the manufacturing segment there is something called Operational Technology which refers to the Machines, engines, robots, automobiles and the likes that drive the world related to mechanical and industrial engineering. Now, there is another term Information Technology that is much more popular. <b>This Industrial internet is the amalgam of OT and IT to generate valuable insights and patterns in the industries to be used in real time.</b><b><br></b>Industrial Internet is something many industries are using these days. In the large turbines, engines, and other manufacturing machine tools, there are thousands of sensors and actuator fitted which gather the data about temperature, rpm, vibrations, lubricant condition and many more things and then transmit it to this software. This software has the ability to handle GBs of data on an hourly basis which it analyses in real time, compares it with existing data, reports any abnormality and also predicts any threat of failure or need of maintenance. This software can then transmit the data to your smart phones and desktops which you can access through especially designed apps. Through this data, you can easily control the operations in real time, schedule maintenance, improve quality and drastically reduce the downtime.<br>So, when GE decided to open the software for developers, it means that the other industries can use the pre-developed platform and that they do not have to reinvent the wheel. This can seriously boost up the development in this field. GE is actually planning to make it the android or ios of the Industrial internet world. SoftBank has already acquired the license to develop Predix.&nbsp;<br><b>But to say that it is going to help the medium and small scale industries in recent future is not justified in present circumstances. GE has opened the software to developers but it has not actually open-sourced it as it happens in the CS world. </b>SO, it won\'t be possible for other companies to directly use and develop the platform. The SMEs in India &amp; China are still miles behind when it comes to being able to use it.<br>To read more, follow this <a href=\"http://www.gereports.com/post/99494485070/everything-you-always-wanted-to-know-about-predix\">link</a>.<br>','2015-07-07 07:22:07',0,1,'19:23:04',1,25,1),(26,1,2,0,'&nbsp; &nbsp;According to me reason for this kind of failure could be misalignment. For two rotating part being welded it is very important that there axis remain linear. Otherwise even a small degree of nonalignment cause vibration and cycling loading. There are deformation during Welding process and they are even more for circular welding. You might not feel it with naked eye for small length part, like Hub. But if you are not fixing it properly during welding process there will be some deformation.&nbsp;&nbsp; &nbsp; Since Your hub does not failed in joint, there is no issue with weld quality. Use &nbsp;rigid jigs and fixture for entire welding process till the hub cool down.','2015-07-07 16:58:21',0,1,'22:42:24',1,26,21),(27,0,3,0,'It\'s difficult to reach a conclusion with this pic. But the profile of the failure in the hub suggests that it is not shear as that would have given a more uniform surface at the point of failure. <b>The non-uniformity of the profile suggests that it has occurred slowly over a period of time. The most probable is the fatigue failure.&nbsp;</b><br>It might have started with a small crack or scratch in the plate. There must be some misalignment in the axis as the last answer suggests. Due to that, the wheel would have been wobbling a little. That leads to cyclically varying axial force at the joint. Plus it is near to a welded joint where you might not have followed standard welding processes like pre-heating and post-heating the joint. Also the finish of the component suggests that the welded joint was not polished or grinded properly. The hub is rusted as the pic suggests that means it might have undergone enough stress cycles.<br>All of these things combined give rise to the ideal conditions for a fatigue failure. To prevent this in future just &nbsp;make sure to check all the things i have mentioned.','2015-07-07 18:04:53',0,1,'22:43:25',1,26,1),(28,0,2,0,'You must keep in mind the belt of the CVT is in tension and that is related to the torque. So when the belt tightens up, it applies force on the shaft from the gearbox. The image suggests that you people have machined two plates for both sides of the Piaggio gearbox in which this bearing was put at the far end. So the most common reason for this kind of wear would be a little inaccuracy in machining leading to a little compliance or play.&nbsp;<br>Also, clean the gearbox oil before re running the vehicle. The left out pieces of metal many a time work as abrasives causing such wear and tear. You may also try to make some setup to filter out the weared out metallic particles magnetically so that they may not cause any further harm thereby reducing the chances of wear.','2015-07-08 12:20:45',0,1,'13:53:54',1,27,2),(29,1,2,0,'You can go for Stepdown reversing Magnetic field to get the expected result.&nbsp;<br>What you will have to do is create or purchase a setup that passes DC current which must be reversing and decaying in nature through a large solenoid. That means the direction of the current should keep on alternating between -I and I multiple times in a second. Also the magnitude of the current should keep on decreasing constantly. This would generate a stepdown reversing magnetic field in the solenoid. After this if you pass the iron scrap through solenoid on a conveyor belt in calculated amount of time so that each batch of iron scrap heap passes through this reversing magnetic field and undergoes the decay until the magnitude of the current and thus the magnetic field becomes zero.<br>This is one way to demagnetize the iron scrap and is followed by many industries.','2015-07-09 17:14:09',0,1,'14:21:19',1,28,1),(30,1,1,0,'If you are using axis symmetric geometry then give the same mass flow rate.Otherwise, Divide actual mass flow rate by actual area and multiply the result with product of breadth of 2D section with 1 m .<br>&nbsp;Actual mass flow rate (Kg/s) / Actual area (m^2) = Mass flux (Kg/m^2s)<br>Mass flux remain constant, therefore&nbsp;<br>Mass Flux(Kg/m^2s) * (Breadth(m) * 1(m) ) = Mass flow rate for 2D model &nbsp;(Kg/s).<br>','2015-07-11 23:41:50',0,1,'22:30:27',1,30,38),(31,0,0,0,'These three\r\ndifferent mathematical behavior are basically derived from solving the\r\ngoverning partial differential equations. As in normal conic equation, the\r\nconditions are simply calculated from whether the value of b^2-4ac is greater\r\nthan, less than or equal to zero. I expect that you know these things and only\r\nwant to understand the physical significance of different types of equations.<br>\r\n\r\nHyperbolic\r\nEquation:<br>\r\n\r\nIn a hyperbolic\r\nequation, solving for x and y we get a specific point in space where the two\r\nreal characteristic curves meet. So the region of influence lies in one\r\ndirection of the intersection only as shown in the first figure. The physical\r\nsignificance you can understand by this: \r\n\r\nSteady Inviscid\r\nsupersonic flow is normally hyperbolic with respect to direction of flow. The\r\nsimple reason is that the disturbance produced by some object going at\r\nsupersonic speed within fluid cannot get past that object as the disturbance is\r\nalso a wave and speed of a wave in air is the speed of sound in air. \r\n\r\nUnsteady\r\nInviscid flow is hyperbolic with respect to time. The explanation is again very\r\nsimple. In normal life situation, the effect of the disturbance cannot be felt before\r\nit happens. That means in a time marching equation, a disturbance in time t\r\nwill only cause disturbance in the fluid in time after the disturbance.<br>Parabolic\r\nequation:<br>In a parabolic\r\nequation, there is only one characteristic curve through any given point. So the disturbance at one point will basically create a disturbance between the boundary conditions after that point.Unsteady Boundary layer flow follow this parabolic equation as they are viscous in nature. Also, the Unsteady Thermal conduction follows parabolic equation with respect to time.<br>Elliptical Equation:<br>When the value of b^2 -4ac is negative, the solution is imaginary and there is no real characteristic curve. So you cannot solve it by marching technique normally. Any disturbance at any point of time will cause disturbance in the whole domain in the entire area lying within the boundaries.<br>The steady Subsonic Inviscid flow follow this equation as the disturbance wave can travel faster than the body thus is able to disturb the entire domain. Except this Incompressible inviscid flow also follows this equation. the reason is simple, the speed of sound in incompressible fluid is infinity causing all flows to be subsonic.<br>I would further recommend you to read some standard text books which have explained it quite well like Computational Fluid Dynamics by John D. Anderson','2015-07-12 05:35:41',0,1,'11:55:34',1,29,1),(32,1,1,0,'Good mesh is the mesh which gives good accuracy in least possible time. What method I used is to keep on refining mesh size till I reach sufficient accuracy.   its important to refine only at some particular section of geometry, else mesh size will be unnecessary reduced, which will take long time for solution. Best way to reach appropriate mesh size is keep on iterating till two successive analysis are close to each other. Shape of mesh element also decides the accuracy. For example hexahedral geometry should be preferred over triangular or quadrilateral geometry for better accuracy. Mesh quality can be improved by using smoothening of mesh. <br>','2015-07-13 17:03:56',0,1,'22:51:14',1,31,21),(33,1,0,0,'The rule in Baja SAE competitions have almost remained the same. However the implementation has increased severely in past 5-6 years.<br>The rules relating to safety and clearances have almost always been the same. I have seen the rulebook from 2009 to 2015 and have not noticed any significant and noticeable change. That regarding the 64 inches of width has always been the same globally. You might be talking about implementation of that rule in a particular event or a country.','2015-07-14 18:33:36',0,1,'00:03:36',1,5,1),(34,0,3,0,'I have a little experience with CFD and structural analysis so i would like to give it a try. But this question is to broad to be answered in limited space. Try to ask specific questions that can be answered definitively.<br>First you have to keep in mind that meshing for structural analysis and that for CFD is very different. I have only used meshing tools of ANSYS but if you are doing it for serious uses and on a large scale you should look for ICEM, Hypermesh or Gambit etc.&nbsp;<br>Ansys workbench provides good options and optimizes the mesh depending on whether you are using it for CFD or structural. I have not looked into other modules like E-Mag etc. In Ansys classic (APDL), you have few options but in workbench you have multiple options and all those cannot be explained in this answer. For that we can have another question.<br>When doing Meshing for CFD analysis, you should first determine the fluid domain that you are about to work on and should have an idea about the boundary condition that are to be applied. Considering a viscous flow, you should do arrangements for boundary layer flow. In the boundary layer flow, the velocity would change drastically in first few millimeter so the mesh size should be fine in the direction of the flow. Ansys Fluent provides many options relating to this like proximity control, mesh generation based on boundary condition, control the size of mesh elements, type of mesh like hexa, prismatic, octahedral, and much more. Along with these things, it depends upon whether you are keeping turbulence modelling in mind or the flow is steady, viscosity of fluid etc. But to start with keep the mesh size medium if you are using the fluent meshing options. After that, as the other answer suggests, keep it bringing down until the variations in the results start diminishing. That again depends upon the kind of accuracy you are looking for.<br>When doing structural analysis, yo might not have as many options as in CFD and neither do you need that many.<br>While deciding the size of the mesh, you must consider the geometry and use features like proximity control etc. The areas having high stress concentration like corners and joints etc. must be meshed fine so as to capture the sudden variations in the stress. In other areas you should increase the mesh size to reduce the amount of computation done.&nbsp;<br>Finally, the mesh size is actually dependent upon the kind of accuracy you are ok with. So keep on iterating, you will get enough idea when you see the differences. In the initial phase concentrate more upon the profile of the mesh based upon boundary conditions and geometry of the domain or object. The exact size is always a secondary matter.','2015-07-14 20:59:04',0,1,'20:33:53',1,31,2),(35,0,1,0,'&nbsp;Modal Analysis is used to analyse natural mode shape and frequencies of an structure during vibration. For example modal analysis of building is done to determine natural frequency of building. If Natural frequency of building matches with that of earthquake, then building will resonate with earthquake. And that can be hazardous. Ansys is widely used for Modal Analysis of vehicle. It give acceptable result.<br>&nbsp; &nbsp; Coming to your concern about vehicle frame, as other structure modal analysis is used for vehicle frame. But Modal analysis cannot be used for analyzing vibration caused by Engine or suspension spring, Actually it is done<b> For determining Natural frequency during Free Vibration</b>. It uses &nbsp;mass and stiffness of structure to determine &nbsp;shape of different mode of vibration. It don\'t deal with actual force applied on the frame. From Vehicle frame You can constrained it at bottom and do the modal analysis under its own weight. Then you need to verify that frame doesn\'t resonate with engine or vibration from Road. You need not to concern about deflection caused, they are arbitrory.\r\n			    ','2015-07-15 17:14:35',0,1,'22:59:54',1,32,38),(36,0,3,0,'Dear Rahul,<br>UNITIZED BEARINGS capable of handling dynamic load of up to 78100 Newton &amp; static Load of 104000 Newton would suffice the endurance needs of BAJA vehicle... Good thing about the unitized bearings is that there usage&nbsp;eliminates the need for heat treatment and precision finishing of &nbsp;both thrust bearing backup surfaces.<br>Its also important that the bearings are still protected with atleast 1.8mm thickness hub cover (bolt able&nbsp;type would be easily available) Also ensure that the Gasket for hub cover is not cork but paper gasket....<br>Using two bearing would suffice.....&nbsp;you will be able to find such bearings with RSB(where even FR axles would also be available you make like to take idea &amp; modify there FR axles used in many SCVs... other sources are SKF &amp; NBC .<br>This is based out of experience of 3 years in Automobiles &amp; 3 stints at BAJA ..... &nbsp;Wish you the very best&nbsp;','2015-07-15 18:12:51',0,1,'11:19:35',1,33,19),(37,0,2,0,'I think you should start with understanding what options are available and the cost associated with them. I am giving a little detailed answer as compared to the other answer by @Yash which is compact but very useful.<br><br>First I will go with common and safe conventions and then we will see how calculations are done. The common parameters are the trackwidth of the vehicle, the center line of the wheels and the distance between the outer and inner bearings and with the wheel centerline, the weight of the wheel assembly or the unsprung mass of the quarter car, radius of the tire, condition of the road etc. Then in the bearing, there comes the bore diameter, outer diameter, width of the bearing, single race or double race, tapered or normal and a hell lot of types especially designed to tackle different types of loading conditions like axial forces etc.<br>You can easily go with 2 bearings, the normal size would be around 15-20 mm bore with the minimum possible od which will be around 40 mm. You can use different bearing sizes for outer and inner bearings and for that you will have to use a stepped shaft in the knuckle. The more the distance between the centerlines of the bearings, the better it is. Also, somehow try to keep the centerline of the wheel between the bearings as that will significantly lower the load as compared to the wheel centerline lying at the end of the outer bearing but you will face a little problem with calliper positioning trying this. Considering the design of the hub and the knucle, you will find that in the rear, you will normally be able to use larger bearings which decreases the design issues.<br>The bearings should be sealed to prevent the dust and sand from entering the bearing as that will surely destroy the bearings. Along with that, if you are making a Baja ATV, you should do extra arrangemets to prevent mud from entering the bearing area. The expected life is calculated in terms of distance traversed. There is no need for tapered bearings or roller bearings. Simple deep groove bearings would fit the purpose and would come cheap.<br>There are manuals and catalogs available on the internet from different vendors like Timken, SKF, Tata Bearings etc. Check the dynamic and static loadings of the bearings.&nbsp;<br>For the exact calculations, you should look into <a href=\"http://poisson.me.dal.ca/~dp_12_13/fterm.pdf\">this pdf</a>. Best of luck.','2015-07-15 19:59:44',0,1,'13:11:17',1,33,2),(38,1,2,0,'They do it by dynamically changing the angle of attack of the wings multiple times in one complete rotation of the wings.&nbsp;<br>While the wing is moving in the direction of the velocity of the helicopter, the angle of attack is decreased and increased when coming the other way round. So, this way they manage the lift and prevent the roll. But then due to the difference in drag another problem of yaw is introduced which must be taken care of. This some times is taken care y the rear rotors which neutralize the torque and multiple other thing taking place simultaneously.&nbsp;<br>The setup is called swashplate assembly which manages the angle of attacks of the rotor blade. <a href=\"https://en.wikipedia.org/wiki/Swashplate\">Read more here</a>&nbsp;about swashplate.&nbsp;Also see this <a href=\"https://en.wikipedia.org/wiki/Swashplate_(aeronautics)#/media/File:Taumel_142_b.png\" style=\"line-height: 1.42857143; background-color: white;\">image from wikipedia</a> to get a little more understanding.&nbsp;The helicopter is a complex hing and i am no expert.','2015-07-16 15:35:27',0,1,'11:07:39',1,35,79),(39,0,3,0,'I would say refer to the Curie temperature (Tm). This temperature varies from steel to steel. Depending on the composition of your steel,you could find the right temperature from any thermodynamic package like Factsage etc.&nbsp;Just heat the scrap to that temperature (usually above austenizing temperature)<br>','2015-07-17 17:27:58',0,1,'22:18:44',1,28,212),(40,0,2,0,'This website is not meant for this kind of questions. Better ask it on <a href=\"https://www.quora.com/\">Quora</a>.<br>However I wold like to give some explanation. Are you are really interested in these things? Because right now you would not even know about these things. CAD is computer Aided design. Autocad, catia, unigraphics etc are CAD softwares. These are used to do 2D &amp; 3D modelling of objects from a nut to an aeroplane. In colleges you will get cracked version of these softwares and use them. But what will you use them for? You need to have some requirement. For that, you should be involved in some kind of projects like robotics, aero-design, baja, formula etc. There you will really need these things.<br>As for ANSYS, that is an analysis software used to analyse different kind of mechanical designs. The analysis of stress, strain, failure and all those things. I would suggest to go for it once you have mastered Mechanics of materials and design of machine elements. Then only you will understand the use of that software.<br>Do some research on this. And there are multiple other softwares being used by people in mechanical engineering like Fluent, MATLAB etc. Read the theory first. There is a lot of things to know before you learn these softwares. best of luck.&nbsp;','2015-07-17 18:01:30',0,1,'02:53:11',1,36,216),(41,1,1,0,'You have used the mid section of the damper fluid domain to do the analysis of a cylindrical domain which should be the root of the problems as I can see.<br>What you should do is use Ansys Fluent to do the analysis taking a 3D model. Better take a triangular section of the damper, apply in addition to the other boundary conditions symmetric surface condition th the two plane surfaces in the triangula arc section. That would give you the values closer to the real one. Also, the flow might be turbulent so you will have to use the turbulence modelling too. Since the viscosity is high, you should take appropriate measures.<br>I &nbsp;think you need to try 3D.','2015-07-17 18:54:09',0,1,'12:54:44',1,34,216),(42,0,4,0,'No you do not need to take stress concentration factor into account when calculating static stress in a ductile material like steel as they redistribute the load when it reaches the limit.<br>I quote from Roark:-<br style=\"color: rgb(0, 0, 0); font-family: Tahoma, Arial, Helvetica, sans-serif; line-height: 16.466667175293px; background-color: rgb(222, 222, 255);\"><br style=\"color: rgb(0, 0, 0); font-family: Tahoma, Arial, Helvetica, sans-serif; line-height: 16.466667175293px; background-color: rgb(222, 222, 255);\">\"If the load on a structure exceeds the value for which the maximum stress at a stress concentration equals the elastic limit of the material, the stress distribution changes from that within the elastic range. Neuber [\'Theory of Stress Concentration for Shear Strained Prismatic Bodies with Nonlinear Stress-Strain Law\', J. Appl. Mech, Series E, vol. 28, no. 4, pp 544-550, 1961]presented a formula which includes stress and strain. Defining an effective stress concentration factor, Ksigma=(sigma max)/(sigma nom), and an effective strain concentration factor, Kepsilon =(epsilon max)/(epsilon nom), Neuber established that Kt is the geometric mean of stress and strain factors. That is, Kt=sq. root of Ksigma*Kepsilon, or Ksigma=[(Kt^2]/Kepsilon. In terms of the stress and strains, this can be written as (sigma max)*(epsilon max)=[(Kt)^2]*(sigma nom)*(epsilon nom)<br style=\"color: rgb(0, 0, 0); font-family: Tahoma, Arial, Helvetica, sans-serif; line-height: 16.466667175293px; background-color: rgb(222, 222, 255);\"><br style=\"color: rgb(0, 0, 0); font-family: Tahoma, Arial, Helvetica, sans-serif; line-height: 16.466667175293px; background-color: rgb(222, 222, 255);\">Kt and sigma nom. are obtained exactly the same as when the max stress is within the elastic range. The determination of epsilon nom. is found from the material\'s elastic stress-strain curve using the nominal stress.\"<br><br>Making it simple, If you have a plate of thickness t and width W with a small hole in it with width w, the stress distribution will be like that shown in the figure. So when you calculate for fatigue loading conditions, you will have to consider stress concentration factor, but when you are looking for impact conditions which are one time and not cyclic, you can peacefully ignore it the calculation in that case would be like this&nbsp;? = F/(W-w)t.<br><br>In the roll cage you are talking about, the places you might consider stress concentration factor would be the area which faces the stress from engine mounting and the suspension joints. In the other places and condition like front impact, roll-over and other impacts, there is no need for it.','2015-07-18 07:31:28',0,1,'19:48:27',1,37,1),(43,0,3,0,'I would like to elaborate Sumedh\'s answer a bit more.<br>To know what exactly happens, we must know how a magnet behaves before and after heat is applied to it. Before a magnet is heated, all its magnetic domains are aligned in more or less in the same direction (A magnetic domain refers to a region inside the magnet where the magnetic effect is in a particular dimension ie. the magnetic movements of all its atoms are aligned in the same direction).&nbsp;<br>As we excite these regions by providing thermal energy, these domains gain energy to free up themselves from the adjoining domains and they sometimes reorient themselves such as to reduce the stress around them. As a result now the magnetic domains might point into different directions. As a result, the net effective magnetic field is reduced. Now if you keep on heating, a point is reached where the tendency of atoms to align themselves in unidirectional magnetic direction ceases to exist. This point is called Curie Temperature and it is different for different materials. It is important to note that such material when cooled will lose most of its magnetic nature only IF no other external magnetic field is applied while it was cooling down.<br>Curie temperature of the magnet would depend on the exact composition of the material.','2015-07-18 16:29:51',0,1,'22:18:43',1,28,27),(44,0,3,0,'Of course they are! As a matter of fact many components used by ISRO and HAL are manufactured by Medium Scale industries. As an example, I am considering the&nbsp;<b style=\"line-height: 1.42857143;\">Mission and Combat System R&amp;D Centre (MCSRDC) of HAL. The purpose of MCSRDC is to&nbsp;</b>design and develop Integrated Avionics Systems for Fixed and Rotary wing aircrafts.<br>Bellow is the Vendor list of MCSRDC:<br><a href=\"https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0CB0QFjAAahUKEwj5oKWLkeXGAhWNbY4KHUXgBAM&amp;url=http%3A%2F%2Fhal-india.com%2FCommon%2FUploads%2FDMS%2FMission_Combat%2520System%2520Research_Design%2520Centre.pdf&amp;ei=Q4OqVbnzEI3buQTFwJMY&amp;usg=AFQjCNGzyDhyLEfsHl3Ck1yTtVaJPFth8Q&amp;sig2=G_B8k5E1VoRd4s-QUPIyJA\">https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0CB0QFjAAahUKEwj5oKWLkeXGAhWNbY4KHUXgBAM&amp;url=http%3A%2F%2Fhal-india.com%2FCommon%2FUploads%2FDMS%2FMission_Combat%2520System%2520Research_Design%2520Centre.pdf&amp;ei=Q4OqVbnzEI3buQTFwJMY&amp;usg=AFQjCNGzyDhyLEfsHl3Ck1yTtVaJPFth8Q&amp;sig2=G_B8k5E1VoRd4s-QUPIyJA</a><br>As you can see many vendors are not large scale industries but rather medium ones.<br>But you have also asked whether the \'Make in India\' program has provisions to enhance the SME quality standards. While I don\'t know the exact provisions of this program but Why should the Make in India program has to explicitly state to a company that they have to manufacture optimum quality products? Isn\'t that obvious? In order to survive in competition any &amp; every industry has to improve its product quality and meet the desired standards. Moreover when we manufacture such high precision components, we use techniques like EDM, Laser Cutting, ECM, 3 D printing etc. which are very accurate in nature. In order to manufacture such high precision components, industries would have to buy machines capable of manufacturing using such techniques.&nbsp;<br><br>But yes, we make mistakes and thats how we learn.Eg: On July 10 ,2006 GSLV carrying INSAT 4-C failed about 55 seconds after liftoff from&nbsp;ISRO’s&nbsp;Satish Dhawan Space Center at Sriharikota. The reason is said to be to be excessive fuel flow through a regulator. The diameter of the regulator was 17 mm instead of the required 16mm.<br>','2015-07-18 17:03:58',0,1,'02:51:32',1,39,27),(45,0,2,0,'In the great words of&nbsp;R.S. Khurmi and J.K. Gupta<br><i>\"Each part of a machine, which moves relative to some other part, is known as a kinematic link (or simply link) or element.&nbsp;link or element need not to be a&nbsp;</i><i style=\"line-height: 1.42857143;\">rigid body, but it must be a resistant body. A&nbsp;</i><i style=\"line-height: 1.42857143;\">body is said to be a resistant body if it is&nbsp;</i><i style=\"line-height: 1.42857143;\">capable of transmitting the required forces&nbsp;</i><i style=\"line-height: 1.42857143;\">with negligible deformation.\"</i><br>Is belt a part of a machine : Yes &nbsp; &nbsp; Does belt have relative motion : Yes &nbsp; &nbsp;Is belt a resistant body: I think so!<br>&nbsp; &nbsp;So can we consider Belt to be a link: Its your call !!!&nbsp;','2015-07-18 17:17:35',0,1,'02:51:53',1,38,27),(46,0,0,0,'Besides inaccurate machining, incorrect gear alignment (and its accompanied vibration) is a huge factor to excessive gear tooth wear. The image you attached is very small. But as you said that this helical gear was attached to a set of standard gearbox gears,&nbsp;it seems to me that there may have been very high vibrations in the shaft. Check to ensure that the shaft is firmly secured/supported at the other end.','2015-07-18 17:33:17',0,1,'23:03:17',1,27,27),(47,0,1,0,'<b>Short Answer:</b>A seamless pipe should theoretically have more strength as compared to a seamed pipe.<br><b>Long Answer:</b>Go through the manufacturing process of seem less pipes<a href=\"https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=2&amp;cad=rja&amp;uact=8&amp;ved=0CCQQtwIwAWoVChMIw-fPz6blxgIVTgiOCh3kPA5h&amp;url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DlueB6RvqMSo&amp;ei=15mqVYOgLM6QuATk-biIBg&amp;usg=AFQjCNEHjyMZPe-80ChVHnA7QjZUBjZnXg&amp;sig2=_Y7wTRNSn9pxBxHPo7x3dQ&amp;bvm=bv.98197061,d.c2E\">https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=2&amp;cad=rja&amp;uact=8&amp;ved=0CCQQtwIwAWoVChMIw-fPz6blxgIVTgiOCh3kPA5h&amp;url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DlueB6RvqMSo&amp;ei=15mqVYOgLM6QuATk-biIBg&amp;usg=AFQjCNEHjyMZPe-80ChVHnA7QjZUBjZnXg&amp;sig2=_Y7wTRNSn9pxBxHPo7x3dQ&amp;bvm=bv.98197061,d.c2E</a><br><br>and that of seemed pipes&nbsp;<a href=\"https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0CCMQtwIwAGoVChMIkvXy8aflxgIVglOOCh1Vvg-i&amp;url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3D0x1uRR9Jb34&amp;ei=LJuqVZKvAoKnuQTV_L6QCg&amp;usg=AFQjCNFw8tMEkt7ohD6fhGydMcxXiqYvLw&amp;sig2=bb9eG5FyQhYbzzSE0G691A&amp;bvm=bv.98197061,d.c2E\">https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0CCMQtwIwAGoVChMIkvXy8aflxgIVglOOCh1Vvg-i&amp;url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3D0x1uRR9Jb34&amp;ei=LJuqVZKvAoKnuQTV_L6QCg&amp;usg=AFQjCNFw8tMEkt7ohD6fhGydMcxXiqYvLw&amp;sig2=bb9eG5FyQhYbzzSE0G691A&amp;bvm=bv.98197061,d.c2E</a><br><br>Now a seamless pipe should not have any point where there is a lot of stress concentration. This is because it is free from the defects of welding. Moreover, during seamless manufacturing, the pipes undergo strain hardening which increases the strength of the pipes. If I were you, I would try and use seamless pipes for roll cages. You never know when the seamless pipes might rupture when you try to bend them.<br><br>','2015-07-18 18:49:01',0,1,'00:27:01',1,24,27),(48,1,0,0,'The Awesome Body goes here ...','2015-07-21 11:59:39',0,1,'14:17:17',1,41,1),(49,1,4,0,'Lets start wit some key points<br style=\"line-height: 18.5714282989502px;\"><ul style=\"line-height: 18.5714282989502px;\"><li>GrabCAD has opened its workbench for everybody and it is free to use now. You can share your CAD models, work on existing CAD models on the website, change the design and details and then submit it for revisions<br></li><li>Arena has established itself as the pioneer in providing cloud based PLM &amp; PDM services.<br></li><li>Dassault System, AutoDesk and PTC are working hard to capture the market in CAD SaaS(software as a service).<br></li></ul><br style=\"line-height: 18.5714282989502px;\">But the question about small manufacturing units in India and china being able to use PLM &amp; PDM is not a simple one. The small manufacturing units are basically doing everything on papers right now in many industrial areas. Those who have gone beyond that are using spreadsheets and all to do all kind of management. Many of them are purely manufacturing units who are not using CAD softwares. Most of them who are supplying parts to Large industries in automotive segment are working on drawings (EDs) provided by these companies and in normal condition don\'t even need CAD and PLM software. Some other companies are these days providing browser based PLM(Thin client interface) to their vendors so as to keep them in sync with the changes being made in designs and details. Most of the small manufacturing units in these countries manufacture products for one industry only which is another limiting factor.<br style=\"line-height: 18.5714282989502px;\"><i style=\"line-height: 18.5714282989502px;\">At one hand, the service is being provided and basically within the reach of small industries. However on the other hand, these Industries are not ready for using these facilities owing to the lack of exposure and lack of proper knowledge.</i>&nbsp;One more thing about these small units is that they are little resistant to changes because they operate on low margins and are fearful about the competition. Until somebody shows them a clear advantage of using PLM without too much cost involved in migration, they are not going to adopt it.<br style=\"line-height: 18.5714282989502px;\"><b style=\"line-height: 18.5714282989502px;\">So when it comes to the future of PLM &amp; PDM software providers, the whole thing basically needs a wave of adoption. And when it hits the market, the one who is able to cater to the specific needs of these industries is going to have significant advantage over others.</b>&nbsp;&nbsp;<br style=\"line-height: 18.5714282989502px;\">These are my personal views and I am not an expert but i think i am gonna dive into this thing. I am not even going to reveal my identity right now. :)\r\n			    ','2015-07-21 12:05:42',0,1,'02:51:10',1,41,216),(50,1,2,0,'The less the tyre pressure, the more would be the area of contact patch and vice versa.<br>For a baja vehicle, setting correct tyre pressure is very important. The optimum tyre pressure is written on the tyre itself. Keep that in mind. When you are going in muddy track, the tire pressure should be as low as possible. Even something around 10psi would do but that depends upon the tire you actually have. In rocky terrain, you should have low tire pressure but not too low or you may encounter flat tire or rim distortion when the ATV hits a rock. Better keep it about 15-20 psi in suspension test. In dirt terrain, like that in the endurance race, you should have the combination of speed, stability , maneuverability, you should keep it a little higher but that depends upon the type of track provided.<br>High tire pressure is good for stability at high speed and acceleration. So, in acceleration and speed test, keep it near the max around 30 psi but that depends on the tire. In endurance race and maneuverability you can have something around 25psi.&nbsp;<br>These figures are approximate. Everything depends on the type of tire you are using, ply, tubed or tubeless, weight of the vehicle and many more variables. Read the instructions from the tire provider to decide. Also, test the vehicle at different tire pressure in different conditions. That will give you better idea.','2015-07-23 16:27:23',0,1,'14:19:59',1,40,1),(51,0,1,0,'I think the answer is quite simple. It should be Solar Energy. The reason being it is clean. Unlike nuclear energy, it is not risky to use and there are no direct harmful effect. Silicon which is the primary constituent of a solar panel is widely available and is one of the most abundant element on earth. Many companies like Applied materials, Tokyo Electrons etc are working on the etching technology for creation of silicon wafer etching and it has been developed to a great extent.<br>Other energy sources like geothermal, tidal, wind &nbsp;are also there which are being used widely. Wind energy might also be significant, may be like alcohol(good solvent) according to your analogy.<br>','2015-07-23 20:14:54',0,1,'10:40:16',1,42,216),(52,0,3,0,'The working of a self balancing unicycle can be explained by the basics of rotational mechanics.<br>There is a gyroscope which determines the inclination, acceleration and changes in the momentum of the unicycle. That gives its response to the motor which drives the unicycle. That motor, based on the response from gyroscope adjusts the torque it provides to the wheels.<br>The working after that is quite simple:<br>If the mass(rider) on the unicycle leans forward, a moment arm is created causing torque which tends to make the driver fall in the direction he leans. But then the gyroscope judges it and provides a toque which acts on wheel and that on reaction with ground creates frictional force in forward direction. this frictional force provides the counter torque and also the driving force which leads to acceleration.<br>Now your question is about torque required to drive it at a constant velocity of 12kmph. Like every other thing on wheels, you do not require any forces to move it at constant velocity except that to counter the rolling friction and drag. tht depends on the type of tyre, weight of rider, type of surface and many other things.<br>But you donot need to care about that as the driver can adjust his weight to maintain a constant speed. A better question might be about the acceleration and power of the motor.','2015-07-24 08:45:52',0,1,'20:33:30',1,43,281),(53,0,2,0,'&nbsp;Generally Higher Tyre Pressure Increase tyre grip. Higher the pressure lower will be the slip angle for a given cornering force.&nbsp;Therefore if you want, say, more over steer increase the front pressures and/or decrease the rear pressures. These are only general guidelines. and are generally true for pressure range &nbsp;of 25-35 psi.&nbsp;<br>&nbsp;How your tyre performs is function of many variables like Tire type, manufacturer , Treads depth, track, Weather condition Driver etc.Apart from handling tyre pressure do effect factors like Stifness, Mileage , Steering Effort etc.<br>&nbsp;lower tyre pressure provide springing effect. And thus reduce stiffness of your suspension.Higher tyre pressure acts like stiffer spring transferring more load to &nbsp;your suspension. Detailing each effect here is not possible. you can find good detail about effect of tyre on Car in RCVD by Millikan and Millikan and Tune to win by Carol Smith&nbsp;','2015-07-25 16:32:02',0,1,'14:19:54',1,40,38),(54,0,4,0,'Grab cad being the cloud storage for cad models is already providing free work bench where an individual can share his own cad model design and updates across the world.I believe it is currently feasible for all industries and individuals and also in future we are going to see such more sites being launched by cad companies ( eg: solidworks , catia etc) .&nbsp;Arena for data management storage, is doing a pretty good job in product data management, bill of materials management. Main advantage of it is we can access our files from anywhere not bothering of whether we are using company domain or not. But such PLM sites are charging &nbsp;pretty good amount per each license due to less number of competitors available in market. In future we will see more data management sites which will further reduce the cost of data storage.&nbsp;Lets hope for the best<br>','2015-07-25 20:16:23',0,1,'11:36:34',1,41,289),(55,0,1,0,'You can have a look at UDF(User defined function) in Ansys.<br>In this basically you have to use C or C++ to define the variables on which the property is to vary and define the relation or the function according to which it varies with respect to the applied parameters.<br>With a UDF, you can change the boundary condition or mesh shape/size or geometry of the domain dynamically with respect to time when solving a time marching equation. Have a look at <a href=\"https://www.youtube.com/watch?v=rT3a-Lu7LI4&amp;list=PLKNCm0NndLN-a_m75192N3bsjNVsxjmhJ&amp;index=2\">this video on youtube.</a>','2015-07-26 09:04:30',0,1,'14:34:42',1,44,216),(56,1,1,0,'I would suggest that you should first try to understand the mechanics involved.<br>In a unicycle, there are multiple forces and torques operating. When you ask about the torque required, you should be clear about the mechanics, the FBD, and the forces. from your question it is not clear that if the unicycle is manual or automatic. Please edit the question and provide appropriate details.','2015-07-26 09:15:34',0,1,'21:18:57',1,43,216),(57,0,1,0,'MOST is one of the most well documented and most sophisticated method of work measurement and motion and time study. It is used to do the time study of shopfloor jobs such as work in production lines to the clerical works being done in offices. Every step, movement, type of motion and control is documented and you write the code and calculate the time taken for each movement and that can be taken as a standard time required for doing that work.&nbsp;<br>However, the conditions you are talking about is little different. I think that the finishing of casting products is bit difficult. Also, If there are cavities and cores involved in the cast part. Some parts may take a little more time in fettling and ginding and removal of sand deposits and core deposits in the cavities. So based on the complication, each block would take different amount of time. But even then you can use MOST to analyze and measure taking the average and continuously modifying the readings.<br>But it is not very efficient for this kind of work.','2015-07-27 19:17:49',0,1,'02:29:26',1,46,216),(58,0,2,0,'there are either coarse or fine threads in a bolt.The pitch in coarse threads is higher compared to fine threads.Material property is same as that is dependent on Standards ie: Metric 8.8, 10.9 etc<br>coarse threads are preferred over fine threads in most applications.1.They are cheaper.2.They usually provide the required clamping force in majority of applications.3.They are more resistant to mishandling because of more material in threads , ie: more thickness of threads when measured from top to &nbsp; &nbsp;bottom.4.they have more tolerance for defects, ie: while tightening coarse threads are more forgiving .This is due to stress distribution in threads,if a thread in fine type fastener is stripped, there is less tolerance for the fine type thread to accept the additional load which equates to higher probability of failure of subsequent threads.5.During tightening or loosening, a coarse type threaded fastener requires less turns than fine type.(less threads for the same length of fastener). thus saves time during assembly.<br>A fine type threaded fastener is better in applications where the clamping load to be applied is more than a coarse type thread fastener can bear keeping the same length of thread engagement, material standard and diameter.This is because it has more tensile stress area onto which the force can be distributed more evenly.(due to more threads for same length).','2015-07-28 17:30:47',0,1,'00:39:01',1,45,322),(59,0,1,0,'Great answer by Robinson. However, I would like to add a few points.<br>Fine threaded bolts and nuts are more preferable in vibrating components as they have lesser tendency to loosen due to vibration. The reason is their low helix angle.<br>There is one big problem in fine thread regarding the handling of the bolts and nuts. Even a small iron filing or sand particle can destroy the thread and make the bolts unusable(Galling). Coarse threaded bolts are more forgiving.<br>Fine threads may be problematic in bending cyclic load as the finer thread may cause stress concentration in valleys.','2015-07-28 19:29:50',0,1,'11:02:54',1,45,2),(60,1,2,0,'No, the preload does not reduce the capability to carry external applied tension.<br>When the nut is tightened on the bolt at the joint as shown in your figure, the portion of the bolt between the head and the nut elongates and that elongation is the measure of preload. Now when you apply the separating force at the joint, it has to first reach the magnitude of preload in order to create any more tensile load on the bolt.<br>The point is that the two faces of the joint press each other and the resulting normal reaction is countered by preload. When you try to separate the two plates which are bolted by applying force, first the normal reaction between them reduces same amount as applied force thus the tensile load on the bolt remains the same until the normal reaction forces reduce to zero.<br>so if the preload is x and the tensile strength of the bolt is x+y, the force you have to apply on the joint before the bolt yields is x+y and not y. I think it is clear now.','2015-07-31 05:52:19',0,1,'11:37:32',1,50,1),(61,1,2,0,'Great Question.&nbsp;<br>Se it this way, You have a magnet and an iron bar. You place the magnet near the iron bar. The iron is attracted towards the magnet but the magnet is also attracted towards iron. If no other external force is applied, each of them move towards each other and the center of mass of the system does not move as the force is internal. In this case no work is done as there is no displacement of COM.<br>Now, if you are holding the magnet or the magnet is fixed in any way and it attracts the iron bar towards itself then the external force comes from you or where the magnet is fixed. So in this case the work is done by that external force and not the magnetic force.<br>Tell me if I am wrong.','2015-07-31 11:49:54',0,1,'20:53:49',1,49,2),(62,0,2,0,'Topological errors in Catia is common. When you try to make a part and the way you are making it is not possible then it shows this error.<br>For example, you are trying to use rib with a center curve having extreme curvature at some point along with a profile so that the solid being formed after rib is self intersecting. In that case you are likely to see topological errors.<br>Another case may be if an infinitely thin sliver is left in doing the operations like filleting etc. then you might see this kind of error. The exact reason may depend on the way you are doing the operation. But basically it is something that is generated by unclear and normally impossible to create geometry.','2015-08-01 05:20:01',0,1,'12:19:12',1,52,281),(63,0,1,0,'Stress concentration as you might know is caused by sudden changes in the geometry of the object that leads to stress field distribution turning from uniform to non-uniform.<br>The first thing you have to keep in mind is that when you are talking about stress concentration, you are talking about that non-uniformity of stress fields. For example, If you have a large plate with width W, and thickness t and there is a hole with small radius w. When you calculate the stress it is not simply F/(W-w)t all over the width(uniform distribution) which should be the case had there been no stress concentration. On the contrary, the stress is more if the diameter of the hole is less. It can be as high as multiple times the value calculated with above mentioned formula.<br><b>So, now it should be clear that the value of stress is not simply proportional to area when there is the case of stress concentration. So everything is about the stress field distribution.</b> As you might see in figure, the sudden small changes in geometry are more harmful than bigger changes with smooth edges. That is why strategically providing more holes reduces the stress concentration.<br>The rest of the things you will understand if you see the stress concentration charts carefully which suggests the stress concentration factor reduces with increase in fillet radius or hole radius.','2015-08-01 06:05:41',0,1,'11:12:29',1,55,281),(64,1,0,0,'The question is not very clear. You are asking whether you should use rose joint/hiem joint or ball joint in the multi-link suspension. In a multi-link suspension there would be 5 or 6 joints. Which specific joint are you talking about. However, I think that at most of the points you should use hiem joint only. The hiem joint operates in double shear condition which many times makes it better than ball joint.&nbsp;<br>The question would be more specifically answered if you can provide more details like CAD model etc and you specify which particular link and joint you are talking about. However, I think that if you have an option of using both, you should go for hiem joint as that is more reliable.','2015-08-01 08:22:10',0,1,'13:52:10',1,53,72),(65,0,2,0,'<b>Generally MIG welding &nbsp;filler material have higher strength than that of Oxyacetylene gas welding. But oxyacetylene welding can be used, and was &nbsp;used, for High strength application like aircraft Race cars etc. But it required very good welding skills, proper weld setup, proper penetration to produce good quality of welding. With MIG, welding is comparatively easy with more penetration. Oxyacetylene welding give clean welding. For welding thin thickness Oxyacetylene welding cant be used. It is preferred for thick pipes and sheets as it &nbsp;produces large amount of heat over large area.&nbsp;</b><b>&nbsp;</b><b><br></b><b>&nbsp; For roll cage I think most teams use MIG welding. Logically you should not use Oxyacetylene welding for roll cage as Tubes used are of less thickness then preferred &nbsp;for oxyacetylene welding. On other hand MIG welding can be used effectively even for very thin pipes.</b>','2015-08-01 15:44:48',0,1,'22:34:02',1,51,364),(66,1,-1,0,'k-epsilon and k-omega both models are used for turbulence modelling only. The k is the kinetic energy. In k-epsilon, epsilon is the rate of dissipation of kinetic energy. It predicts the flow behaviour based on dissipation and thus simplifies the complex calculations. k-omega is also used in same way. The k-epsilon model is used in the thin viscous layer whereas the k-omega model is used in the outer layer.<br>','2015-08-02 13:51:28',0,1,'19:21:30',1,48,2),(67,0,1,0,'Modal analysis in Ansys is like free vibration of articles in a vibration testing scenario. It is used for finding the natural frequency of the body. The free vibration testing is done without any attachments (minimum attachments actually like freely hanging with a tie or rope). It doesn\'t take into account the external factors like the mounting, the loading, interactions with other parts. This technique is mainly used to evaluate the test fixture in shaker based vibration testing or to understand the response of a body to the induced vibration during the development stage.','2015-08-02 14:25:09',0,1,'14:24:20',1,32,15),(68,0,1,0,'Boundary representation is the methodology in which the part is created taking into account its boundaries. It would be a collection of surfaces, edges and curve and the relation is defined appropriately.<br>In CSG, the object is created by performing boolean operations on relatively simple solids like cuboids, prisms, sphere, cones and other shapes. The final shape is an aggregate or overlaps (union/intersection/addition etc.) of constituting simple shapes.<br>The B-rep is more robust and is used normally for generation of complex geometries. It is less complicated and relatively more complex objects can be created with less data and less computation.&nbsp;<br>However, the commercial CAD software like CATIA, UG etc. do not use these methods directly.&nbsp;BRL-cad uses CSG but it is not that much into the competition. Anyway there is a complete dominance of B-rep and Parasolid kernel in this segment.<br>I wold love to see another answer from some expert.','2015-08-03 12:55:22',0,1,'00:28:42',1,56,216),(69,1,2,0,'As per my awareness, FE Analysis is done to understand the behaviour of material under certain load or pressure condition. So, it needs the component to be analysed and hence the component is meshed and analyzed using FEM. Wheras in case of CFD, the area of intrest is the surrounding of component and the intrrface surface regarding different parameters like heat flow, aerodynamic flow, etc... Hence it involves FInite Volume Method to analyze the volume around the component to check heat flow or aerodynamic flow.','2015-08-03 19:05:02',0,1,'02:20:15',1,59,284),(70,1,1,0,'While grinding the drill bits, you should consider the rake angle and relief angle of the tool too. Sharpening the drill bits without considering the rake &nbsp;and end relief angle wont help too much. Generally inappropriate relief angle causes excessive heat generation and you problem seems to be related to that only.<br>As for guidance see this <a href=\"https://www.youtube.com/watch?v=72syhJoOsHM\">Video.</a>','2015-08-04 03:57:56',0,1,'09:28:04',1,61,116),(71,1,1,0,'FEM is also used in CFD (Ansys APDL) but it requires more computational resources. FVM in that case is better because it takes the flux on boundaries. FVM has distinct advantages over FDM(finite difference method) &nbsp;and for same accuracy FVM has to do much less computation.<br>FEM is used in structural analysis as it takes the length derivative into account which is directly proportional to stress. It also has certain advantages when it comes to domain deformation.','2015-08-04 05:19:19',0,1,'11:49:52',1,59,1),(72,0,2,0,'Radial engine is an otion if you want to maintain the same engine architecture or else try exploring about Wankel engines if interested in different engine architectures. This helps ? ','2015-08-04 05:27:34',0,1,'19:27:54',1,62,366),(73,0,1,0,'As the last answer suggests, the strength of mig weld is more because of the filler material used. MIG is easier to use and can be learnt easily.&nbsp;<br>However wit OA, you can achieve more ductile weld joints. In a welded body, the weld is the strongest part both theoretically and practically. The weak part is the heat affected zone or the HAZ. So when you are talking about strength, you should be concerned about that. In OA weld joint, the HAZ is larger but it doesn\'t go brittle. If welding high or medium carbon steel, MIG might lead to brittleness of HAZ.&nbsp;<br>But in OA, the excessive heat can lead to warping of the metal. MIG is difficult to use with thin tubes. An experienced welder would be more comfortable welding thin tubes with OA. But then again, it is matter of practice. I have welded 1.5 mm thin tube with MIG. So it is not that big a problem. Many teams use TIG for welding roll cage as that is better in terms of bead control. However, in terms of ease, MIG is better.','2015-08-04 12:01:53',0,1,'00:29:09',1,51,1),(74,0,2,0,'This is seriously a great question and great debates are going on it.<br><br>I would go against the last answer. If you take the FBD of the object being attracted, clearly, work is being done on it.<br>The right answer is that when you say that the magnetic field cannot do any work, you are talking about point charges. However, the practical objects in the practical world cannot be compared with point charges. And the magnetic field can do work on magnetic dipoles. A bar magnet will accelerate in magnetic field.<br>However, have a look at these two questions on stackexchange.<br><a href=\"http://physics.stackexchange.com/questions/67826/how-can-magnets-be-used-to-pick-up-pieces-of-metal-when-the-force-from-a-magneti\" class=\"question-hyperlink\" style=\"margin: 0px 0px 1.2em; padding: 0px; border: 0px; font-size: 21px; vertical-align: baseline; color: rgb(5, 135, 172); line-height: 1.3;\">How can Magnets be used to pick up pieces of metal when the force from a magnetic field does no work?</a><br><br><a href=\"http://physics.stackexchange.com/questions/10565/does-a-magnetic-field-do-work-on-an-intrinsic-magnetic-dipole\" class=\"question-hyperlink\" style=\"margin: 0px 0px 1.2em; padding: 0px; border: 0px; font-size: 21px; vertical-align: baseline; color: rgb(5, 135, 172); line-height: 1.3;\">Does a magnetic field do work on an intrinsic magnetic dipole?</a>','2015-08-04 13:36:59',0,1,'00:31:39',1,49,396),(75,0,2,0,'Ansys is a classic FEA software used for stress analysis for large number of applications. It provide option of many element types. A very good quality of mesh can be generated to get very accurate result. Caesar is a software used by oil and gas company for stress analysis of pipes. It use simple beam theory for calculation. And one can get very close result to Caesar by hand Calculation. What Caesar can do, Ansys can do it more accurately.<br> Caesar  is used by piping company because it is more practical for them, as it has pre defined terms used by industry. And result is acceptable by industry standard. If you want to use FEA for general application than go for Ansys. It is much more powerful tool than Caesar.','2015-08-04 15:25:55',0,1,'22:16:42',1,63,364),(76,0,3,0,'For CAD systems, there are multiple geometric modelling kernels. Parasolid, Romulus, Open Cascade,&nbsp;Convergence Geometric Modeler are a few of the more popular ones. Out of these, open cascade is a free and open source project and quite a good point to start with.<br>As for free and open source CAD software, there are software like BRL-CAD, FreeCAD, OpenSCAD available in mechanical segment. Most of these are either for windows OS.&nbsp;<br>You can have a look at this <a href=\"https://en.wikipedia.org/wiki/Geometric_modeling_kernel\">link</a> to get some pointers.','2015-08-05 20:27:58',0,1,'15:46:48',1,64,336),(77,0,4,0,'<b>#define BMod 0.001<br>#include\"udf.h\"</b><b><br></b><b>DEFINE_PROPERTY(cell_density,c,t</b><b style=\"line-height: 1.42857143;\">)</b><b style=\"line-height: 1.42857143;\"><br></b><b style=\"line-height: 1.42857143;\">{</b><b><br></b><b>real mu_lam;<br>real temp=C_T(c,t);</b><br><b>if(temp&gt;= 295 &amp;&amp; temp&lt;= 299)&nbsp;</b><b>&nbsp;</b><b><br></b><b>&nbsp;mu_lam = 870;<br>else&nbsp;&nbsp;</b><b><br></b><b>&nbsp;if (temp &gt;= 301 &amp;&amp; temp&lt;=343)&nbsp;&nbsp;</b><b>&nbsp; &nbsp;</b><b><br></b><b>mu_lam = 870/(BMod*(temp-301)+1);<br><br>return mu_lam</b><b><br></b><b>;</b><b><br></b><b>}</b><br><br>This is correct code as per the condition you have given assuming Beta to be 0.001.&nbsp;You have not given any condition for T = 300 . &nbsp;This may show error. &nbsp;mention complete requirement.Hope this helps.<br><br>','2015-08-08 06:25:40',0,1,'15:52:39',1,66,51),(78,0,2,0,'Though I dont have any practical experience on this. Still I will try to help you.<br>For hard steel EP oil should be used. Generally Water &nbsp;Emulsion are used for low carbon steel. Harder the steel gets more EP capability of cutting fluid is needed. Its also depend upon cutting speed. Higher speed require more cooling.&nbsp; For High speed &nbsp;water emulsion are used.&nbsp;For medium speed Water emulsion and EP additives &nbsp;and for low speed Oils with EP additives are used.<br>You can check catalog &nbsp;for options available in market.<br><br>','2015-08-08 07:27:36',0,1,'10:13:50',1,60,364),(79,0,1,0,'I would suggest you to go with opencascade, an open source CAD kernel development project. It was open sourced in 2000.<br>Have a look at the git repository to it.<br>1.&nbsp;<a href=\"http://dev.opencascade.org/index.php?q=home/get_involved\">http://dev.opencascade.org/index.php?q=home/get_involved</a><br>2.&nbsp;<a href=\"https://github.com/tpaviot/oce\">https://github.com/tpaviot/oce</a><br>This will give you a fair idea to get involved.<br>Also have a link at this.&nbsp;<a href=\"https://github.com/erossignon/node-occ\">https://github.com/erossignon/node-occ</a><br>As the Readme.md suggests:<br>OpenCascade nodejs extension for solid modeling.This nodejs extension provides&nbsp;solid construction&nbsp;to nodejs. It provides a simple yet powerful javascript api to construct 3D geometry models.This project comes with a set of V8 wrappers around OpenCascade API and a sample web application.<br>Also, Have a look at the github repository of&nbsp;<a href=\"https://github.com/BRL-CAD\">BRL-CAD</a>. An open source CAD software. You can directly see the codes and understand how you can get involved. Also you can download and start using it.','2015-08-08 07:57:17',0,1,'13:27:21',1,64,1),(80,0,1,0,'While solidification of &nbsp;Cast Iron Graphite is produced which has lower density than liquid metal, hence Cast Iron expand on solidification. Its same like Ice have more volume than water.','2015-08-09 02:34:31',0,1,'22:54:55',1,67,22),(81,1,2,0,'I have worked only upon Teamcenter. I think it is too heavy an application to be used by a medium scale industry. When i say to heavy, I am talking about cost, customization and usage. It is basically designed for large Industries who have operations going on around the globe and which have people involved in design and manufacturing on different location.<br>So from my point of view, Teamcenter at least is not your thing. I have heard that Enovia is a bit better for medium scale enterprises but I have no idea about that.','2015-08-11 13:56:33',0,1,'19:25:56',1,68,2),(82,0,3,0,'I dont think that it is advisable for a medium scale industry to use a PLM suite. Earlier it was said that PLM is not for smlla nd medium businesses. But in 2000s, many PLM providers tried to get to SMEs also. But there is no significant improvements in this field. The reasons why I am telling this are:<br>1. High installation cost<br>2. Difficulties in customization<br>3. Lack of scaled down PLM software suites.<br>But if you still need to decide you should look into many details like which CAD software you might be using or planning to use. What problem you are trying to solve with new PLM installtion. What is the size of your industry and how many people would be using the PLM &amp; CAD software directly.&nbsp;<br>If you have only PDM requirements, you should look at platforms like GrabCAD etc which are cloud based and don\'t require initial cost. Also there are cloud based PLM providers which you can look into before making a final decision. The rest of it depends on the kind of product you are manufacturing, the kind of management and approval system you follow and how diverse is your need. For clearing these things, you should contact the various PLM providers and judge directly from their feedbacks.&nbsp;<br><br>Have a look at this <a href=\"https://www.linkedin.com/grp/post/60570-77556469\">Linkedin discussion</a>','2015-08-11 14:40:17',0,1,'19:25:55',1,68,416),(83,0,2,0,'You are talking about fluid or solid? What actually are you trying to simulate. Please edit your answer to include necessary details.&nbsp;<br>In APDL it is quite simple. You will have to follow the normal procedure of creating the domain, meshing it according to you needs and then define the load steps(Thermal) in order to reach the solution.<br>Have a look at <a href=\"https://www.youtube.com/watch?v=kb0HYixRADM\">this video</a> which clearly explains how should you proceed. It will be a time marching solution and you will have to move the heat source for every time step by changing the nodes.','2015-08-11 15:40:41',0,1,'22:43:33',1,70,281),(84,1,1,0,'you need to use AC current, DC will only re-magnetize it.  Depending on \r\nthe item, whacking it with a hammer will also help de-magnetize it.  I \r\ncan\'t see the fairly weak field bothering any motor, and a AC motor I \r\nimagine could be self-degaussing when run.    I have used a solenoid \r\ncoil, like one off of the modular gas/liquid industrial valves, by \r\nitself as a degausser.  You shouldn\'t have to look hard to find one in \r\n120VAC, liberate it from the rest of the solenoid, attach a line cord, \r\nand go\r\n			    ','2015-08-11 16:47:51',0,1,'11:34:06',1,28,465),(85,0,2,0,'The video correctly sums up how to do this. However if you are doing it in Ansys APDL, you can easily reduce the work by creating a loop to automatically apply point load on the node, create load step file and then delete the load.<br>(Just an illustration, modify according to your needs)<br>temp_source = 3000<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">time_increment = 5<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">lscount = 0<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">time_count = 1<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">*DO, i, x_min, x_max,20<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">lscount = lscount + 1<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">TIME, time_count&nbsp;<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">D, NODE(NX(i),NY(y_loc),NZ(z_loc)),TEMP,temp_source<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">LSWRITE, lscount&nbsp;<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">DDELE, ALL, ALL<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">time_count = time_count + time_increment<br style=\"font-family: Arial, sans-serif; font-size: 13px; line-height: 16px; background-color: rgb(241, 243, 245);\">*ENDDO<br><br>With this kind of a loop, you can loop over the node across the length of the domain or wherever you want. After this you can solve it with command LSSOLVE,1,lscount<br>However a little slow, but APDL is great for solving these things. Go ahead. refer to APDL guide if need help.','2015-08-11 20:39:11',0,1,'21:25:38',1,70,416),(86,0,5,0,'Thermodynamics tells us that a pure material has a very high tendency to develop or acquire flaws during processing, fabrication or during its service life. These flaws include but are not limited to voids, cracks, metallurgical inclusions, dislocation or a combination of their ilk.&nbsp;When a component is designed and subjected to the intended loading conditions, the inherent crack in the material will tend to propagate, in a direction subject to the orientation of grains and the applied force. Fracture toughness of a material tells us the resistance a material can offer to that crack propagation.&nbsp;&nbsp;This is quantified by using a stress intensity factor(K) which depends on applied stress, length of the inherent crack and geometry of the sample. \r\nIt varies with the component thickness and saturates after a certain value of thickness. Thinner sections show better toughness properties.&nbsp;Strength and toughness are contradictory in nature. Materials at values slightly less than its UTS have shown considerably lower toughness. So it is different at different stress levels. It is also dependent on the heat treatment operations and aging process.So the same material can exhibit varying toughness when subjected to varying physical metallurgical processes. Precipitation or phase transformation at crack tips can enhance the fracture toughness of a material by causing the crack tip to encounter a harder phase, impeding the propagation as in case of TRIP steels.\r\nMaterials with lower toughness have a tendency for brittle fracture which is catastrophic because it occurs suddenly. The desirable form of failure in most of the cases is ductile fracture which is obtained when crack propagation is slowed down.\r\n			    ','2015-08-12 10:35:29',0,1,'20:51:22',1,71,115),(87,0,1,0,'Maximum principal stress theory: Used for brittle materials and cast iron<br>Maximum shear stress theory: Used for Ductile materials<br>Distortion energy theorem(shear strain energy theorem): Also used for ductile materials<br>Strain Energy theorem: ductile material<br><br>','2015-08-12 18:49:00',0,1,'06:36:38',1,69,396),(88,0,2,0,'You will have to write the UDF exactly defining the relation between shear strain rate and the viscosity.<br><br>See this <a href=\"http://www.cfd-online.com/Forums/fluent-udf/63840-viscosity-udfs.html\">discussion on CFD-online</a>','2015-08-13 05:17:04',0,1,'19:27:08',1,72,1),(89,0,4,0,'I am not an expert but I have a few things to share.<br>Fracture toughness is the measure of the resistance of the component to undergo failure in case any internal or external crack is present in the material. The less the fracture toughness is, the more the material is prone to brittle failure due to crack propagation.<br><br><br>Fracture toughness is an indication&nbsp;of the amount of stress required to propagate a pre-existing flaw.<br><br><br>Now, what is the role of fracture toughness in design of an structure or selection of material?<br>You should consider a rule of thumb. The better the grade of the metal is, the lower is it fracture toughness that means the notch sensitivityof the metal is higher making it prone to brittle fracture. For example, you have steel or aluminium of different UTS, the grade of material with low UTS will have higher fracture toughness and vice versa. So aluminium alloys like 7075 &amp; 6016 t6 are more sensitive to any notch and are not able to handle internal flaws as the lower grade of aluminium alloys. Thus T4 will be better than T6 in terms of fracture toughness. Have a look at the image attached.<br><br>So, it is better to use low UTS alloys with larger cross section as compared to high UTS alloy with small cross section even if they have the same strength.<br><br><br>Fracture toughness is measured experimentally and denoted by KIc.&nbsp;KIC = Y???c. <br><br><br><br>','2015-08-13 15:48:35',0,1,'19:27:19',1,71,396),(90,1,1,0,'Have a look at <a href=\"http://usa.arcelormittal.com/globalassets/arcelormittal-usa/what-we-do/steel/plate/plate-product-brochures/201504_a514-and-t-1.pdf\">this PDF</a>','2015-08-14 12:16:10',0,1,'19:26:56',1,85,2),(91,0,2,0,'<a href=\"http://www.efunda.com/materials/alloys/alloy_steels/show_alloy.cfm?ID=ASTM_A517_GradeF&amp;show_prop=all&amp;Page_Title=ASTM%20A517%20Grade%20F\">This page</a>&nbsp;gives the elastic modulus(tangent modulus) of&nbsp;ASTM A517 Grade F. have a look.&nbsp;<br><a href=\"http://www.azom.com/article.aspx?ArticleID=6724\">This one</a> gives&nbsp;the elastic modulus(tangent modulus) of&nbsp;ASTM A514.<br>&nbsp;I think that the tangent modulus is almost the same for HSLA steel and infact most of the steel. that is around 210 Gpa. &nbsp;So you can take it approximately 210GPa. The only difference that is theer is in the UTS or yeild strength and other properties. Young\'s modulus is almost the same.<br>Hope this helps.','2015-08-14 18:02:34',0,1,'10:30:14',1,85,416),(92,0,0,0,'I am not very sure but you can have a look at <a href=\"http://www.researchgate.net/publication/260523367_Load_Profiles_of_Selected_Major_Household_Appliances_and_Their_Demand_Response_Opportunities\">this paper on researchgate</a>.&nbsp;','2015-08-14 21:18:56',0,1,'02:48:56',1,87,281),(93,0,0,0,'Aerospace Engineering is a very vast field. Its almost all the engineering aspects coming together to fly a plane. You need to first narrow down your option. Like you want to go for structures, Engines, hydraulics, control systems, embedded systems, air management system, air conditioning . And I guess taking everything together will make you a shallow engineer. I suggest you to think about it and come up with the field you want to see yourself in future. Every topic I mentioned (and many more I\'ve not even heard of probably) are equally important and equally challenging. Mastering any of these can be pretty interesting. Once you have decided upon a field, there are people in this group who can suggest you about how to start.&nbsp;','2015-08-15 02:06:15',0,1,'18:20:47',1,93,15),(94,0,2,0,'Sign convention is same as used for Simple Bending and Axial loading. If P is tensile it will be positive otherwise negative. For bending, if bending moment to the left of cross section is clockwise it is positive otherwise negative.Hope this help.<br><br>Edit:<br>You should use one particular convention for all calculations, calculate the stress due to different loads like bending, axial etc and then add all of them along with their respective sign(= &nbsp;or -) to get the final value of stress at a point.&nbsp;','2015-08-17 01:12:32',0,1,'21:24:35',1,106,364),(95,0,1,0,'I believe both techniques hold their own sets of pros and cons.<br>Anyway, <u>electro-galvanised</u> coating deposits a <u>thin layer</u> whereas <b>hot dipping</b> deposits a <b>thick layer</b>.<br>Applications for electro, I guess, are for tight fitting components where space is of concern and some protection is required.Hot dipping is thicker and more resistant.','2015-08-17 09:06:48',0,1,'19:49:59',1,80,657),(96,0,1,0,'This is too broad a question to answered definitively.&nbsp;<br>Under water welding is very similar to normal welding done normally in workshop or in air. You can have both types of welding done dry or wet.<br>You might be more confused about wet welding and thinking why the welder does not get electric shock or how the arc is generated. In underwater welding, the current is controlled by high quality switches. The shielded metal arc welding is done and the slag prevents the water from touching and corroding the hot and molten metal. The arc is created and controlled the way it is done normally. However current needs to be switched off as soon as the arc is to be stopped or welding is finished. Also, if you have done MIG welding or other arc welding you might be familiar that it is not likely to get electric shock from a welding equipment as the voltage difference in which it operates is very low.<br>In dry welding, dry chambers are created with high pressure and that has some effect on weld joints too.&nbsp;','2015-08-17 15:42:18',0,1,'18:58:32',1,97,216),(97,0,0,0,'Tangent modulus Is best defined from experimental data. If you are using stress at yield / strain at yield than must be getting large variation from actual answer. Ramberg Osgood formula give more accurate result. But you need to know some more specification. You can ask for specification from manufacturers of A517 steel','2015-08-17 17:40:30',0,1,'02:40:15',1,85,663),(98,0,1,0,'write this command D=double(S) // this will converts the symbolic object S to a numeric object D&nbsp;\r\n			    ','2015-08-18 21:50:22',0,1,'03:20:26',1,77,676),(99,0,1,0,'Go for ,If you can find, &nbsp;Megyesy’s “Pressure Vessel Handbook”, there is a chapter on rectangular pressure tank. This book will surely help you.&nbsp;This pdf&nbsp;(<a href=\"http://www.gowelding.com/pv/square.pdf\">click here</a>)&nbsp;may also help you. It is about non circular pressure vessel.&nbsp;<br>','2015-08-19 03:18:29',0,1,'12:05:24',1,110,663),(100,0,1,0,'Wet underwater welding directly exposes the diver and electrode to the water and surrounding elements.&nbsp;Divers usually use around 300-400 amps of direct current to power their electrode, and they weld using varied forms of&nbsp;arc welding.&nbsp;This practice commonly uses a variation of&nbsp;shielded metal arc welding, employing a&nbsp;waterproof&nbsp;electrode.&nbsp;Other processes that are used include&nbsp;flux-cored arc welding&nbsp;and&nbsp;friction welding.&nbsp;In each of these cases, the&nbsp;welding power supply&nbsp;is connected to the welding equipment through cables and hoses. The process is generally limited to low&nbsp;carbon equivalent&nbsp;steels, especially at greater depths, because of&nbsp;hydrogen-caused cracking.Wet welding with a stick electrode is done with similar equipment to that used for dry welding, but the electrode holders are designed for water cooling and are more heavily insulated. They will overheat if used out of the water. A constant current welding machine is used for manual metal arc welding. Direct current is used, and a heavy duty isolation switch is installed in the welding cable at the surface control position, so that the welding current can be disconnected when not in use. The welder instructs the surface operator to make and break the contact as required during the procedure. The contacts should only be closed during actual welding, and opened at other times, particularly when changing electrodes.The electric arc heats the workpiece and the welding rod, and the molten metal is transferred through the gas bubble around the arc. The gas bubble is partly formed from decomposition of the flux coating on the electrode but it is usually contaminated to some extent by steam. Current flow induces transfer of metal droplets from the electrode to the workpiece and enables positional welding by a skilled operator. Slag deposition on the weld surface helps to slow the rate of cooling, but rapid cooling is one of the biggest problems in producing a quality weld.\r\n			    ','2015-08-19 13:25:18',0,1,'18:58:17',1,97,405),(101,0,0,0,'Have a look at <a href=\"http://tirefailures.com/PDF_vf/whitepaper.pdf\">this pdf</a><br><br>','2015-08-19 20:45:18',0,1,'12:04:28',1,114,662),(102,0,1,0,'The main difference between the two lies in the cooling rates. Water has higher heat capacity and hence can withdraw heat from any material during quenching at greater rates than possible with oil quenching.Faster cooling rates leads to martensitic transformation in steels and other such material capable of such transformation. As a result of greater cooling rates, the quenched material shows brittleness,lower toughness properties. Although wear resistance and hardness are considerably increased.&nbsp;','2015-08-20 10:36:59',0,1,'22:29:58',1,111,115),(103,0,2,0,'You do not need to manufacture it through CNC Machining. As you said it will be made of MS then you can take the three parts and weld all of them together to get it manufactured . That will significantly reduce the machining time and cost. You can take this approach:<br><br><br>The flower shaped part can easily be cut out of a 5-7 mm thick steel plate. You can do it through <u>Gas cutting</u> as the actual outer profile does not matter too much and gas cutting can give you approximate shape in very low cost. The Internal circular shape can then be achieved through boring.<br>The central sleeve can be machined out on lathe in regular way making its outer diameter equal to the inner dia of the flower shaped plate and the inner dia of disc mounting plate.<br>The plate for disc mounting can also be made by gas cutting or machining and you can keep it 2-3 mm thick.<br>One thing you will have to consider is that while welding, distortion occurs. You will have to make special arrangements during welding to prevent any distortion of any of the two plates as it might lead to wobbling of wheel or disc. If you follow this method, <b>you can get both hubs manufactured in less than Rs 1000 or so. Best of luck!</b>','2015-08-22 06:44:29',0,1,'13:24:00',1,115,761),(104,0,1,0,'Great question. In terms of chemical reactions and thermodynamic process, tyre manufacturing is actually a very complex process to be explained. It has so many processes, components, additives, and catalysts involved that it is impossible to explain everything. However I would like to outline a little.<br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; line-height: normal;\"><br>Tyre rubber is a synthetic rubber or polymer. It is created by taking natural rubber as starting material. The natural rubber monomer is Isoprene and the elasticity comes in cis variation. The synthetic rubber is made by polymerization of monomers like isoprene, isobutylene, chloroprene etc. The carbon black is mixed in this mixture of natural and synthetic rubber. Carbon black has various effects on tire. It increases the wear resistance of tyre, increases tyre life, It helps in conducting heat from the surface, it makes the rubber water resistant.&nbsp;<br>Carbon black also increases the tensile strength of tire rubber. Compounding styrene-butadiene rubber wth 50% of its weight by Carbon black increases its tensile strength from 2.5Mpa to 20MPa.<br>Vulcanization(Addition of sulphur) process is used to impart many necessary properties to rubber. Its effects are increase of young\'s modulus, reduction of brittleness and stickiness and much more. Adding sulphur obviously increases the crosslinking of polymer chains.<br>After this Antioxidants and antiozonants are added. These all things happen in the mixing process. Accelerators, pigments, silica, etc. are added for all the desired properties.<br>Calendering is done to make uniform thickness sheets, coating rubber on fabric and frictioning. Most of the chemical changes occur in the mixing phase only. After calendaring, the green tyre. In the process called curing, with the help of heat and pressure, the tyre is given its shape and vulcanized.<br>These are the normal processes involved in tire building. Metal fibres are used widely to make the tyre usable and able to carry such loads. The side walls of the tyre are especially treated with antioxidants and antiozonants which are necessary as atmospheric ozone oxidizes the C=C double bonds to aldehydes. Paraffin wax acts as surface barrier and slows down the reaction.<br>You can have a look <a href=\"http://www.slideshare.net/sateeshin/manufacturing-processes-tyre\">at this slide </a>to get little more details<br>Also, to get more understanding of metal fibre usage and their effects, ou can have a look on <a href=\"https://www.youtube.com/watch?v=wA0dX-phO2Q\">this video</a>','2015-08-22 14:42:51',0,1,'16:58:03',1,114,715),(105,1,2,0,'It actually depends on what you are familiar with. 4140 has good amount of carbon content and that is why it should be welded carefully otherwise it would become brittle in HAZ. You are probably welding it for BAJA ATV Rollcage. If that is so, I would suggest you to go with TIG or MIG. TIG requires a little more control but MIG you can start working in one day.<br>If you do not have much experience in any of them, you can probably go for MIG welding the tubes. The yield strength of 4140 is around 420 MPa so you should take a wire of similar strength. I think ER80S-D2 would be good and is used greatly in the industries across the world. So that can be a safe bet.<br>I would suggest you to go for preheating the area to be welded and also maintaining the temperature while cooling if possible. That would be necessary as it has high carbon content and may lead to embrittlement. However, In rollcage, you can skip it. But if there is any joint in a rotating component or facing fatigue loading conditions, you should go for suitable heat treatment.&nbsp;<br>Now coming to current. That actually depends on the thickness of the tube. If it is around 2mm, 120-125 A would be enough But it actually depends upon other factors too. Practice a little, test a little and then draw conclusions.','2015-08-22 18:14:14',0,1,'23:23:43',1,127,416),(106,0,0,0,'As said in the last answer, the difference lies in cooling rate only. However, different composition of steel show different properties when quenches in different quenchants. Properties like Hardness, brittleness, wear resistance are imparted.<br>It is said that&nbsp;You don\'t CHOOSE an oil quench for a carbon steel if you don\'t want to quench fast; instead, you choose a steel that is designed for an oil quench.<br>Oil of course has a lower heat capacity but many things also depend upon vaporization temperature of oil, viscosity, agitation, initial temperature etc factors. In low carbon to medium carbon steel or low alloy steel, if you have to gain some hardness, you have to water quench it. For steel with higher carbon content and high alloy steel, it is better to do oil quenching or air quenching.','2015-08-22 19:53:18',0,1,'01:23:18',1,111,216),(107,0,1,0,'In term of Refrigerant R134a compressor are most common for domestic application.&nbsp;R600a compressor are also popular.<br><br>Reciprocating , Scroll Compressor and Screw compressor are &nbsp; used in Domestic refrigerator.<br>Reciprocating compressor,also known as piston compressor, are more popular for commercial use. They have simple design and low initial cost but are prone to Vibration problem.<br>Screw compressor have meshing screw which rotate to compress air between them. They are quite and have more efficiency than reciprocating compressor, But have lower life.<br>Scroll compressor &nbsp;use spiral disk nested together to compress air. They have highest efficiency. Being fully hermetic design they are difficult to repair.They are more common in automobiles and air conditioning applications.<br>&nbsp;<br><br><br>','2015-08-22 22:19:30',0,1,'04:20:17',1,126,38),(109,1,4,0,'Depends on whether you have any better options . I think I\'ll go generic on this.<ul><li>&nbsp; &nbsp;If you are concentrating solely on engine, choosing the one with better torque and power will be obvious. In similar cases you can compare the torque<b style=\"line-height: 1.42857143;\"> curves, </b>the flatter curves will be more preferable. Moreover choosing the engine (OEM part), designed for a vehicle(cars, bikes, trikes, quads etc) with weight near your vehicle helps because the torque requirement is well taken care of.</li><li>&nbsp;Now if you are planning to use the same gearbox and differentials also, you will have to calculate whether your car has enough traction (weight on powered wheels,inclusive of weight shift) for the first gear torque or the speed at the final gear is really solving the purpose. Cases can be like you might have more power but the speed has been limited by revs and ratios or considering the weight and drag you don\'t need very low ratios. Or a very high revving bike engine (~12k rpm,sports) with low gear ratios wont help much if your car weighs more than thrice or four times the bike on the other hand a low revving bike engine (choppers) might suit your requirements.</li><li>&nbsp;And then comes ease of modifications and the reliability in those changes. Try choosing an engine which can run through the whole race after all the modifications that you have done (less complex ones probably, considering professionals are not involved).</li><li>&nbsp;It entirely depends on your specifications like weight, drag, max speed, acceleration,dimensions etc that which engine or engine-gearbox combo will give you the best optimized solution. Also you can design aiming specific criteria like acceleration and endurance or max speed and endurance ,if not all.</li><li>&nbsp;Now putting Tata Nano engine on these scales you can compare with the other options to see if this the best option for you.</li></ul><ul><li><br></li></ul>','2015-08-23 15:16:04',0,1,'22:27:17',1,120,366),(110,0,0,0,'For Ideal gasses going through throttling process, as Enthalpy remain constant temprature also remain constant. For real gasses change in temperature depends upon Joule Thompson coefficient . I am Quoting from <a href=\"https://en.wikipedia.org/wiki/Joule%E2%80%93Thomson_effect\">Wikipedia&nbsp;</a><br><br>\"<i>As a gas expands, the average distance between&nbsp;<a href=\"https://en.wikipedia.org/wiki/Molecule\" title=\"Molecule\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">molecules</a>&nbsp;grows. Because of the attractive part of the intermolecular force, expansion causes an increase in the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Potential_energy\" title=\"Potential energy\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">potential energy</a>&nbsp;of the gas. If no external work is extracted in the process and no heat is transferred, the total energy of the gas remains the same because of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Conservation_of_energy\" title=\"Conservation of energy\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">conservation of energy</a>. The increase in potential energy thus implies a decrease in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Kinetic_energy\" title=\"Kinetic energy\" style=\"color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">kinetic energy</a>&nbsp;and therefore in temperature.</i><i><br></i><i>A second mechanism has the opposite effect. During gas molecule collisions, kinetic energy is temporarily converted into potential energy (corresponding to the repulsive part of the intermolecular force). As the average intermolecular distance increases, there is a drop in the number of collisions per time unit, which causes a decrease in average potential energy. Again, total energy is conserved, so this leads to an increase in kinetic energy (temperature).</i><i><br></i><i>Within the region bounded by the Joule–Thomson inversion curve, the former effect (work done internally against intermolecular attractive forces) dominates, and free expansion causes a decrease in temperature. Outside the region bounded by the inversion curve, gas molecules move faster and so collide more often, and the latter effect (reduced collisions causing a decrease in the average potential energy) dominates: Joule–Thomson expansion causes a temperature increase.</i> \"','2015-08-26 01:17:31',0,1,'06:47:31',1,129,364),(112,1,0,0,'However, this kind of thing can be easily manufactured by CNC milling and other operations, It is better to manufacture it by welding the pieces as suggested in the last answer.&nbsp;<br>However, I would like to add one point that if you are planning to weld the disk mounting thin plate, be careful as a sheet of 2-3 mm would easily distort.&nbsp;','2015-08-26 08:00:22',0,1,'13:30:22',1,115,416),(113,0,0,0,'You can get it with any local dealers. They call it by the name of Mild Steel.<br>And I think you wont get wrong material if you are asking for MS. If you ask for chromoly or something, they may hand you wrong material but not with MS.','2015-08-26 13:54:11',0,1,'19:24:11',1,125,72),(114,0,0,0,'This question has already been asked and the answers provided are quite good. Have a look.<br><a href=\"http://www.corelogs.com/forum/seamless-or-welded-which-pipes-should-be-used-for-roll-cage/\"><b>Seamless or welded, Which pipes should be used for roll cage?</b></a>','2015-08-27 07:06:37',0,1,'12:36:37',1,133,715),(115,0,1,0,'first and foremost, that engine simply cannot be used because the rulebook limits engines to 610cc, and the tata nano is a 624cc engine.','2015-08-27 15:25:16',0,1,'00:53:00',1,120,775),(116,0,1,0,'I would suggest you to see <a href=\"https://www.youtube.com/watch?v=lGbGopND4-I\">this Youtube Video</a>.<br>Also, fill it with sand from inside and seal the ends to prevent any distortion.','2015-08-27 20:36:05',0,1,'06:12:31',1,130,348),(117,0,1,0,'Maximum stress caused in a Bar caused by Impact of load W felling from height h &nbsp;is given by<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;STRESS<i>i</i> = &nbsp;W/A( 1 + sqrt(1 + 2AEh/WL))<br>where W/A is Static stress say STRESS<i>s</i><i>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</i><i>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</i><i>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;STRESSi</i> = ( 1 + sqrt(1 + 2AEh/WL))STRESS<i>s</i><i>&nbsp;</i><i>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</i><i style=\"line-height: 1.42857143;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</i><i style=\"line-height: 1.42857143;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; STRESSi = n STRESSs</i><br><i style=\"line-height: 1.42857143;\"><br></i>This formula can be easily derived by equating loss in potential Energy of load W to gain in Strain Energy of bar.&nbsp;n denotes impact factor. As you can see from formula, Impact factor is always greater than &nbsp;<b>two . </b>&nbsp;2 is minimum Impact factor taken for impact loading.<br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;<br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br><br>','2015-08-29 20:00:06',0,1,'20:53:07',1,137,364),(118,1,2,0,'From my Experience, I will tell you, if you want to make a winning car, 4 wheel drive is not the way to go. The reasons are very simple.<br>It would add at least 50 kg weight(i have a feeling that it would add even more) to the vehicle considering the gearbox, the shaft transmitting power from one end to other and an extra differential as 4 wheel drive without differential would be the worst thing one can imagine. The design of front knucle, two extra CV joints, and lot more things will add up to weight and cost. Along with that, you would lose some power from that 310 cc B&amp;S engine which is already providing limited power.&nbsp;<br>Apart from this, you wont gain much from using 4 wheel drive. The baja SAE tracks are not desert or extreme mud. they are simple off-road racing tracks with bumps. What you need there is a good suspension and low weight with a robust design.&nbsp;<br>Now considering the limitations, you wont get a gearbox for it with suitable gear ratios. No chance. If you think of designing and manufacturing it yourself, I think that would give you the biggest nightmares. Even if you get all these things done, you would find a hard time getting enough space. The wheel base of the vehicle would go too much.<br>Thats my advice. However, if you are able to install it, that would be a big thing.','2015-09-01 08:50:41',0,1,'10:35:48',1,141,855),(119,1,0,0,'I would suggest you to go with this derivation<br><br>','2015-09-01 09:04:46',0,1,'14:34:46',1,137,855),(120,1,0,0,'You will have to write a simple UDF defining the relation between density and Temperature as given in the equation. You can read about UDF in ANSYS Help.','2015-09-01 16:05:30',0,1,'21:35:30',1,144,855),(121,0,1,0,'As someone anonymous form TCS suggests, nano engine is not fit for the use. However, it has been used in the competition before. You will have to sleeve the engine and change pistons to make it formula student legal. All that work is just not worth the power and torque characteristics that the engine has to offer. A RE 500 is a pretty cheap alternative. If your wallet is heavy, look for a KTM 390 or used 600 class engines.&nbsp;','2015-09-02 09:39:17',0,1,'23:40:43',1,120,873),(122,0,0,0,'The preload causes tension in the bolt shank. The plates are in compression. When the plates are loaded as shown in the question, the bolt shank tension increases but the compressive stress in the interface between the plates starts decreasing. Useful while designing flanges of pressure vessels where a minimum contact pressure at the gaskets is to be maintained to avoid gas leakage.&nbsp;Also useful while dealing with vibratory loads.\r\n			    ','2015-09-02 12:17:22',0,1,'17:47:22',1,50,882),(123,0,1,0,'Following function will work<br><br>#include\"udf.h\"<br>DEFINE_PROPERTY(cell_density,c,t) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; { &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;real mu_lam;real temp=C_T(c,t); &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;mu_lam = (1.2 * pow(10,-5)* temp * temp ) - 0.01134 temp + 3.4978; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;return mu_lam; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }','2015-09-02 15:06:59',0,1,'21:58:58',1,144,51),(124,0,1,0,'IN SAE BAJA a 4 wheel drive is a bad idea because it adds only weight. baja doesnt happens in a desert or in a full muddy conditions, moreover it just adds extra components and complications.if you are very much intrested try mounting engine in the front above r below d suspension box, dat would b challenging','2015-09-03 03:41:55',0,1,'10:35:49',1,141,911),(125,0,1,0,'A rigid truck is the one which has no external trailers attached to it. It is one complete body where the load carrier is mounted on the chassis itself.&nbsp;<br><br>As for the number of wheels, I think it is something related to regulations as there is no technical reason why it cannot have more than 14 wheels. The regulations tell the maximum load a truck should be designed for, the distance between the wheels, the wheelbase, the max load on each wheel, the maximum overhangs etc. considering these things, there might be some calculations for optimum number of wheel to so that all the guidelines are followed and there is no wastage. This might be the reason that upto a max of 14 wheels, everything is good and beyond that would be a wastage of resource.<br>It is my opinion. I am not too sure.','2015-09-04 07:49:37',0,1,'20:44:55',1,145,72),(126,0,1,0,'SUPRA is an Official SAE event in India. It is well established and is much bigger than FSI in term of number of team participating. FSI is a new event which started two or three year ago. It is in its growing stage. Basically both event has same concept. But Supra is more competitive and has higher prize money. If you are a new team You should start with FSI. &nbsp;It will be easy for you. You will learn many thing from it. If you are experienced, you should go for both. &nbsp;\r\n			    ','2015-09-06 02:50:40',0,1,'00:36:32',1,146,22),(127,1,0,0,'Well, this is a very broad and deep question.<br>Roll center is the point around which the sprung mass of the vehicle rolls when a lateral force is applied on the vehicle. Now, by that concept, if the force is applied on the roll center or the line of force passes through roll center, that would not produce any rolling motion in the vehicle. The perpendicular distance between the line of force and roll center acts as the moment arm. Now what is the role of the COM of the vehicle. By newton\'s laws, the overall force on a body can be taken to be concentrated at the COM of the vehicle. So when the vehicle is cornering, the pseudo force (centrifugal) can be applied on the COM and the moment due to it can be calculated by multiplying it with the distance between COM and roll center.<br><br>Now roll center is different for front and rear of the vehicle. The line joining them is the roll axis of the vehicle and in full car model, the roll moment is calculated by taking the distance of COM from the roll axis\' intersection with the vertical plane. Thee roll axis inclination plays a big role in determining the front and rear rolling coefficient of the vehicle which is detrimental in determining the oversteering and understeering characteristics of the vehicle. The relative roll stiffness between front and rear determines the relative weight transfer in front and rear which combined with acceleration and braking gives turn entry and turn exit oversteering and understeering characteristics.<br><br>For calculation purposes, you need to start with the overall weight of the vehicle. Based on that, you will get to know the overall cornering forces required to turn and height of COM defines the weight transfer to the outer wheels. So any moment you are taking will be based on COM of the whole vehicle. Now, when doing the calculation of spring rate and roll rate, you should take the weight of the sprung mass only. Calculation of roll behaviour will take into account the roll stiffness of the vehicle too. This might seem to be little confusing, but you need to keep in mind that in normal conditions, you do not see steady state cornering. So to the weight distribution on wheels is largely dependent on the roll movements of the sprung mass.<br>I think this makes it clear enough.','2015-09-06 07:17:52',0,1,'12:47:52',1,142,855),(128,0,2,0,'Anodization provides an\r\nelectrical resistance property to the surface.&nbsp;<br>&nbsp;The anodization quality can be\r\nchecked using the low level or breakdown test. Apply a 10-12 V supply between\r\ntwo points and check for any current. You should connect a resistor of 10-12\r\nOhms in the line to limit the maximum current to 1A for safety. Now, if the\r\ncurrent flows in the circuit it shows there is a lack of anodization in that\r\nparticular location.&nbsp; The amount of the\r\ncurrent flowing will define the quality of anodization. A full level current of\r\n1A in this case will suggest a complete absence of anodization.&nbsp;<br><br>&nbsp;Make sure to keep the probes more\r\nthan 10 mm apart and 5 mm away from any sharp edges.&nbsp;&nbsp;&nbsp;			    <br><br>The localized corrosion in your\r\ncase may be because of the non-uniform anodization or removal of anodization\r\nlayer in those particular locations due to mis-handling. \r\n\r\nConfirm your test method and\r\nensure it is good for the anodization specification.','2015-09-06 17:51:46',0,1,'00:29:54',1,117,416),(129,1,1,0,'Mesh skewness is one of the most important features that determines the quality of mesh. Apart from skewness, aspect ratio and mesh smoothness is also used to determine the quality.<br>Skewness is basically defined on the geometrical orientation of a mesh. <u>It is <b>not</b> defined \"with respect to nearby meshes\"</u> as you anticipated. It is measured as how much the generated mesh differs from the ideal mesh cell. For example if it is 2D and we are generating quadrilateral mesh, a rhombus would be a skewed version of a square which is ideal in that case. So if the mesh is hexahedral, the ideal shape would be a cube, if it is tetrahedral, it would be equilateral terahedron(shape of methane) and so on.<br><b>It is calculated by measuring the angle between the normal vector of a face wit the line joining the center of the hexahedron or tetrahedron(the geometrical center).</b> The resulting value is divided by the max possible value thus distributing the resultant between 0 and 1. Quite simply, for a perfect mesh, it would be 0 and for the worst, it would 1.&nbsp;<br>In fluent, the skewness of each mesh cell is calculated and a distribution is shown as to what percentage of total mesh lies in what range of skewness. The more the percentage of mesh is near 0, the better is the mesh.','2015-09-09 13:09:04',0,1,'13:11:49',1,148,973),(130,0,2,0,'Well on the basis of my knowledge I can tell you the process of finalizing the welding current and wire speed. First factor in any welding process is the operator because at high current the penetration of weld filler is more and it is good but is operator is not skilled then he will end with holes in pipes. So I will recommend to finalize the welder guy from your team and let him practice on different joints with different thickness of pipe. Now while practicing you can try different current level. And if you want to avoid holes at high level you should increase speed of run. And wire speed depend on how fast welder is moving gun and how much thickness of weld you want. Standard procedure to check the penetration is by X-Ray or other such processes. And Penetration will decide strength of your joint.&nbsp;<br>One more suggestion I would like to give you, if there are gaps between two pipes at joints then you will likely to have holes. Make sure you grind profile with perfect match. and to get rough idea you can observe light produced and sound generated while welding , well for that you will need experienced guy.&nbsp;','2015-09-10 04:55:43',0,1,'18:24:38',1,150,907),(131,1,2,0,'I Found it <a href=\"https://grabcad.com/library/ktm-duke-390-rc-390-1\">here on Grabcad</a>','2015-09-11 11:22:49',0,1,'06:58:10',1,152,467),(132,0,0,0,'Yes you can. If you want to work as a freelancer for mechanical related assignments. Then you can drop your resume at&nbsp;<a href=\"mailto:carrers@Myassignmenthelp.com\" rel=\"noreferrer nofollow\" class=\"external_link\" style=\"color: rgb(43, 109, 173); padding-right: 12px; background-image: url(data:image/gif;base64,R0lGODlhCAAHAIABAJO42f///yH5BAEAAAEALAAAAAAIAAcAAAINjAMJd5q2HoSLzUadKQA7); background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: 100% 5px; background-repeat: no-repeat;\"><u>carrers@Myassignmenthelp.co</u></a><u>.</u>As soon as you will submit your resume you will get a task which you have to complete in 24 hours. The task will depend upon the qualifications you have. Try to submit it as soon as possible. After the evaluation process you can work as a Free Lancer for this website. Hope this helps you.\r\n			    ','2015-09-11 13:15:55',0,1,'18:45:55',1,65,987),(133,0,2,0,'Here is the model on grabcad. Please do compare dimensions with actual engine to verify .&nbsp;<br>https://grabcad.com/library/ktm-duke-390-rc-390-1\r\n			    <br><br>','2015-09-11 16:38:12',0,1,'06:58:09',1,152,907),(134,0,1,0,'Solution is not getting converge. Reduce Under relaxation time. By this solution will take more time but it should converge. If this don\'t work use finer mesh size and check Initial condition. Wrong initial condition may also lead to this error.','2015-09-14 03:14:19',0,1,'11:43:51',1,158,663);
