INSERT INTO `nodes_comments` VALUES (1,'good to see u','2015-06-20 17:50:38',NULL,31,NULL,1),(2,'not for non-core','2015-06-20 19:33:17',NULL,27,NULL,1),(3,'The answer is awesome. But it is clearly suggesting a top down approach which is a little against the lean approach which prophesies a bottom-up approach. Is it possible to take the bottom-up approach in a large scale industry involved in manufacturing? By bottom-up approach, i mean that the change should be suggested from the people who are directly involved in production and then work its way upwards.','2015-06-22 08:23:52',NULL,NULL,4,1),(4,'Very good article. But the future implication of this make in India initiative is still untouched. The question is whether this Make In India initiative is actually going to help the SmEs. its Ok that they are trying to remove the barriers in the way of opening an SME in terms of paperworks and all but are they concerned about the existing ones','2015-06-22 15:59:22',NULL,49,NULL,1),(5,'The answer is awesome. But it is suggesting a top down approach which is a little against the lean approach which prophesies a bottom-up approach. Is it possible to take the bottom-up approach in a large scale industry involved in manufacturing? By bottom-up approach, i mean that the change should be suggested from the people who are directly involved in production and then work its way upwards.','2015-06-22 18:07:31',4,NULL,NULL,1),(6,'a','2015-06-23 04:19:51',NULL,NULL,6,4),(7,'a','2015-06-23 04:19:58',4,NULL,NULL,4),(8,'Good piece of information. However the last line suggests that the approach towards growth tahen by amaron is not too healthy.','2015-06-25 19:24:52',9,NULL,NULL,2),(9,'Your answer shifted from the point a bit. You dindnt discuss about the future','2015-06-26 16:59:32',10,NULL,NULL,1),(10,'What makes things tricky and unique for the defence sector is that unlike the automobile sector the demand in defence is not continuous and sustenance for the SMEs will be a challenge. Also, since the quality can not be compromised with when the defence of the nation is at stakes, therefore the standard of practices has to be raised.','2015-06-28 18:20:31',10,NULL,NULL,5),(11,'You want the elephant in the room, but you can\'t push it in through the window....  Unless and untill the need for technology is realized and the SMEs are pushed to their limits, to a point where technological advancement is their sole hope of survival, the scenario will remain the same. Hope with coreLogs we have a platform through which luddite mentality can be uprooted.','2015-06-28 18:27:20',NULL,68,NULL,5),(12,'India can become exporter of defence equipment\'s. If it can be done  in field of space, it can be done in defence sector also. As of now India doesn\'t have required quality standards. For that joint venture\'s with foreign players is required.','2015-06-29 03:26:56',10,NULL,NULL,22),(13,'Absolutely correct...\r\nThe minimum possible poisson\'s ratio is -1.','2015-06-30 10:48:00',14,NULL,NULL,98),(14,'Are you talking about Aluminium 7075 T6/T4. I think they are quite good in bending strength but not so good in fracture toughness. But anyway Aluminium is a good choice when used in compression only and also, if used in bending mode use sufficient factor of safety as aluminium is prone to fractures.','2015-07-01 14:28:41',18,NULL,NULL,2),(15,'Such a refreshment it was... as a non technical guy','2015-07-04 17:59:39',20,NULL,NULL,108),(16,'Such a refreshment it was... as a non technical guy','2015-07-04 17:59:40',20,NULL,NULL,108),(17,'Well, I enjoyed your answer surya but i have a question here.. is there an option to delete the comment posted, using this website on mobile?? You see this is my third one..','2015-07-04 18:09:44',20,NULL,NULL,108),(18,'Is there some common difference between meshing for fluid domain in CFD and that in structural analysis?','2015-07-13 18:11:08',32,NULL,NULL,1),(19,'We do not accept this kind of questions.','2015-07-18 05:28:07',NULL,NULL,36,1),(20,'Ask your question in forum section..This section is meant for workplace related discussion...','2015-07-19 18:19:35',NULL,279,NULL,243),(21,'Thanks for ur relevant answer.','2015-07-24 05:12:40',51,NULL,NULL,273),(22,'Thanks','2015-07-26 11:53:08',40,NULL,NULL,203),(23,'It is more clearly explained through figures.','2015-08-01 05:34:36',NULL,NULL,55,281),(24,'Yes. I think it is a great platform. This segment needed this kind of a common platform.','2015-08-02 08:46:10',NULL,458,NULL,2),(26,'Ansys, as said, is based on FEM and can be used in a wide range of applications unlike CAESAR II and AUTOPIPE(another software used for modeling and calculating piping stress). CAESAR is completely code based. It models a coarse mesh of stick elements, with just enough resolution to get accurate reactions and bending moments. More of an automated FBD generator than a finite element program. After selecting the piping code,it calculates stresses based on that code. It has a spreadsheet-like GUI for building geometry, and does not accept geometry from anywhere other than Intergraph CADworx . A recent update named FEA Tools performs a more complex evaluation on branch connections.\r\nSo as far as accuracy is concerned, Ansys will give more accurate results. ','2015-08-05 04:44:11',75,NULL,NULL,16),(27,'As far as the oil and gas industry is concerned , which is based on codes and standards; CAESAR II provides with just enough accurate results that are desired by the codes. Also it is very simple as compared to Ansys. ','2015-08-05 04:47:56',75,NULL,NULL,16),(28,'http://beyondplm.com too.\r\n','2015-08-05 14:24:53',NULL,505,NULL,2),(29,'Sir, this is a forum for technical and industry related questions only.','2015-08-08 05:50:52',NULL,NULL,65,1),(30,'thank u very much sir \r\n','2015-08-08 08:45:31',77,NULL,NULL,439),(31,'The answer given is correct.  I Suggest you can also accept the value of Bmod from the user as an argument of the function..  This way you wouldn\'t have to assume an arbitrary value of 0.001. Moreover you can also make default value as 0.001 in case the user doesn\'t enter any value for Bmod during function calling','2015-08-08 16:08:30',77,NULL,NULL,27),(32,'U want to know which bolt to use at who h place??','2015-08-08 16:49:03',NULL,NULL,45,1),(33,'Great answer','2015-08-08 16:49:37',58,NULL,NULL,1),(34,'I was looking for this kind of website for a long time.A great and unique Platform for Industrial Engineering. ','2015-08-09 03:12:10',NULL,458,NULL,22),(35,'Great platform... ;)','2015-08-09 03:16:16',NULL,458,NULL,38),(36,'I think that is purely dependent on the type of industry he is going to. ','2015-08-11 20:16:05',NULL,575,NULL,1),(37,'Bcz of negative thermal expansion.','2015-08-12 11:16:04',NULL,NULL,67,483),(38,'Yeah true.','2015-08-13 18:18:42',NULL,593,NULL,281),(40,'Thanks for your respon.  Brochure just give  yield strength and tensile/ultimate strength. Can you tell me the yield strain and tensile/ultimate strain. I need yield strength, yield strain, tensile/ultimate strength and tensile/ultimate strain for determine tangent modulus.','2015-08-14 14:50:47',90,NULL,NULL,552),(41,'I think, elastic modulus (E) and tangent modulus (Et) are diefferent. tangent modulus cannot be less than zero  or greater than the elastic modulus. ANSYS Help\r\n','2015-08-15 04:59:10',91,NULL,NULL,552),(42,'Ok.. In that case, I would suggest you can go with any High Strength Low alloy(HSLA) steel if you donot get what you exactly want. They follow the same curve. ','2015-08-15 07:04:52',91,NULL,NULL,416),(43,'thanks for your help. ','2015-08-15 10:10:10',91,NULL,NULL,552),(44,'\"you need to use AC current, DC will only re-magnetize it\" - I was talking about decaying DC current. The reversing nature will continuously reverse the direction of magnetization and the decaying of current will ultimately demagnetize it.','2015-08-16 06:17:15',84,NULL,NULL,1),(45,'In that case, it seems that hot dipping would be better than electro-galvanising as the coating is thicker and serves as a better protection for the metal','2015-08-17 15:44:55',95,NULL,NULL,216),(46,'thanks for your help! ','2015-08-18 05:55:25',94,NULL,NULL,72),(47,'Thanks for your suggest.','2015-08-18 07:09:09',97,NULL,NULL,552),(48,'write  this command\r\nD=double(S) // this will converts the symbolic object S to a numeric object D\r\n','2015-08-18 12:13:23',NULL,NULL,77,676),(49,'what have you done till now? Are you using MATLAB or not? Please give little more details.','2015-08-18 18:01:49',NULL,NULL,113,336),(50,'Thanks a lot.','2015-08-20 08:09:35',101,NULL,NULL,11),(51,'You can get the dampers from a dealer in Bangalore.  He is a supplier by the name of PowerSports ATV or something. His contact number is 9845026245. He can ship you the damper of your choice. Talk to him.','2015-08-21 09:54:47',NULL,823,NULL,79),(52,'Attached PDF provides a general knowledge tire manufacturing process with emphasis on defects in steel radial tire but chemical reaction and changes leading to required property of various rubber components like hardness to treads, flexibility to side walls, thermal properties etc. are not touched at all. I want to know about type of chemical reaction like endothermic, exothermic and weight (mass) loss or gain during the reaction etc. ','2015-08-21 11:38:45',101,NULL,NULL,11),(53,'Which City and state\r\n','2015-08-22 06:21:44',NULL,881,NULL,715),(54,'Good topic which is a subject of debate to get into its inside.\r\nIn simple terms it is initiated to reduce imports, increase employment, save foreign currency, increase GDP of country etc. It can convert our country in manufacturing hub for the whole world. We are rich in manpower a very rare resource which appreciates with time and we have proved to the world our intellectual strength by leading in IT sector. But real benefit to our nation will come by use of our resources to benefit our country and make in India just one step in this direction. So far, we have been exporting raw materials like ores and importing finished goods which benefited foreign countries.\r\nIt is not so easy due to dirty politics in our country but we appreciate the idea and let everyone support to it.  ','2015-08-22 08:00:35',NULL,49,NULL,11),(55,'What king of welding you are doing, TIG, MIG what? please make the question more clear.','2015-08-22 17:13:32',NULL,NULL,127,2),(57,'I think You can get MS from local dealers easily whichever city you come from. But Quality is an issue. However you can ask for MS tubes manufactured by reputed manufacturers like Jindal etc. You can consider that of reliable quality.','2015-08-26 08:42:40',NULL,881,NULL,116),(58,'Thanks Mr. Aniket, Couldn\'t open the slide and video. As a common man I feel that fabric or steel is similar to reinforcement rods used in civil construction and its behavior also may be same. I agree that exact answer to the question requires deep thought into the theory and our curiosity demands for that. Thanks again for trying reply the question and also thanks to corelogs site for connecting like peoples.   ','2015-08-26 11:38:18',104,NULL,NULL,11),(60,'you mean 2 mm thickness with some OD and ID?','2015-08-26 16:45:58',NULL,NULL,130,72),(61,'can you explain what you mean by modified nano?','2015-08-27 15:25:56',NULL,NULL,135,775),(62,'Thanks For Answer.... This Impact loading will always be greater than two. It can even be three four or more. Then Why it is generally taken as 2 ?','2015-08-30 06:46:07',117,NULL,NULL,123),(63,'It is generally taken as 2 as if the height is more than 0, then the conditions are different. Then you will have to consider the KE of the object too. In simple terms, in that condition, the effective weight would be higher and the factor can go to 3, 4 or even more depending on the velocity of the object. ','2015-09-01 09:02:56',117,NULL,NULL,855),(64,'As done by AIOUS FORMULA STUDENT TEAM, They have calculated the bore diameter required to bring down the displacement to below 610cc and found the sleeve with closest diameter available in the market. (Maruti zen)\r\nLater they performed various experiments to determine the displacement of the engine.Overally we can do it by reducing the bore dia','2015-09-02 08:53:18',NULL,NULL,135,360),(65,'if,u can help me to write the udf please $','2015-09-02 13:21:20',120,NULL,NULL,439),(66,'THANK U','2015-09-03 11:35:13',123,NULL,NULL,439),(67,'I would like to add that the judge panel is better in FSI and considering the chance to directly interact with the judges and the organizers, you will earn a lot more in FSI.','2015-09-06 05:17:13',126,NULL,NULL,855),(69,'Ask this in quota. You might get answer there. As per my experience there is no chance. Even many eis person do coding.','2015-09-13 11:13:16',NULL,NULL,157,38),(70,'If you require it for sae event, I don\'t think you are allowed to do much in exhaust. make clear what are your requirements. Do you want to design exhaust? Or just want calculation? And what data do you want?','2015-09-13 13:20:51',NULL,NULL,156,22),(71,'Thank You ','2015-09-15 01:35:02',133,NULL,NULL,954),(72,'Thank you \r\n','2015-09-15 01:35:10',131,NULL,NULL,954),(73,'bhai..','2015-09-25 08:37:00',NULL,1185,NULL,396),(74,'us door gagan me.. man bhage sune aangan me\r\n','2015-09-25 08:37:43',NULL,1185,NULL,396),(75,'o re piya','2015-09-25 13:21:40',NULL,1185,NULL,396),(76,'banno ri banno','2015-09-25 13:27:29',NULL,1185,NULL,396),(77,'chali sasuraal','2015-09-25 13:29:32',NULL,1185,NULL,396),(78,'dffsf','2015-09-27 07:40:34',NULL,NULL,171,1007);
