INSERT INTO `nodes_node` VALUES (1,0,'','F',NULL,'CoreLogs is now in the network, have a look at its profile.','corelogs-is-now-in-the-network-have-a-look-at-its-profile','2015-06-13 14:12:12','04:54:52',0,0,1,0,1,1),(2,0,'','F',NULL,'surya has started working in CoreLogs.','surya-has-started-working-in-corelogs','2015-06-13 14:12:25','04:54:52',0,0,1,0,1,1),(3,0,'B','F',NULL,'Welcome everybody!! Let\'s write history.','welcome-everybody-lets-write-history','2015-06-13 14:13:10','04:54:52',0,1,1,0,1,1),(4,0,'','F',NULL,'What problems do organizations face during the implementation of changes in their product designs and how do they control them? For answering this question, I will take some assumptions:&nbsp;<br>1. The organization in question has a diverse product range.<br>2. The organization in question is sufficiently large such that engineering changes cannot be easily implemented by word of mouth.&nbsp;<br>3. For the organization in question, achieving high quality is of utmost concern.&nbsp;<br>4. The cutoff date/cutoff batch/cutoff machine for design change is extremely important.&nbsp;<br>5. The product manufacturing lead time is sufficiently large to effect long spares/raw material inventory.<br>Any mid-large scale manufacturing industry is always in constant state of self-improvement for its survival. Self-improvements might directly refer to value engineering (design changes, raw material wastage reduction, process improvements, quality improvements etc.) or to introduction of a new design all together. In our case, we are more concerned about the design changes which a company wants to implement. For an industry with a diverse range of products having large production quantities, such changes can be particularly difficult to implement.&nbsp; A few of the major problems include:&nbsp;<br>1. Inability of the organization to supply new drawings and remove old ones from all the workstations in its workshops.&nbsp;<br>2. Inability of the organization to supply new drawings and remove old ones to all the concerned vendors.&nbsp;<br>3. Inability of the organization to modify the designated standard production process according to change in the design.&nbsp;<br>4. Inadequate training of the workforce to identify changes in the drawings.&nbsp;<br>5. Inability of the organization to modify existing/manufacture new process aids (jigs/fixtures) to help implement the design changes.&nbsp;<br>The above problems can be solved by using a very flexible design change cycle. The cycle starts by the design department requesting the desired changes in any existing part. These changes are then passed on to the process engineering and development group. This group has representatives/experts from each core competence field of the company (Eg. Machining, Fabrication, Painting etc.). The design changes are then rigorously checked for their feasibility and manufacturing ease. The decision to manufacture the component in house or offload it to a vendor is taken by this group. If the product is to be manufactured in house, the group triggers the action by first information all the concerned shops (machining, fabrication etc.). Any change in the existing production aids design is reviewed as a priority. A review is conducted to check the cost of implantation of a design change w.r.t the importance/criticality of its implantation. All old drawings are collected and destroyed by the process engineering group. New drawings are issued with adequate control instructions. &nbsp;If any alteration needs to be done in the production process, then a process sheet is released (with adequate control instructions) detailing the minute details of the standard production process to be adopted.&nbsp;<br>The Quality Assurance department is tasked with updating the cutoff date/cutoff batch/cutoff machine in which the design change has been implemented. This is done to ensure that the spares manual is updated. In case the parts are made by vendors then similar process is adopted by the vendor support group of the process engineering group. Despite adequate checks in place, no system/process is fool proof as human error always comes into play. Thus, sometimes non implementation of design changes can result in creation of unsafe conditions, reduction in quality, high rework costs etc.','rohit-has-started-working-in-corelogs','2015-06-13 14:27:35','04:54:52',0,0,1,0,1,1),(5,0,'','F',NULL,'It is well known that the aerospace industry needs to follow a much higher quality standard when it comes to manufacturing components of the aircraft and space shuttles. When it comes to ISRO’s missions like MOM etc, it becomes even more important. In the aerospace industry, it is widely accepted that the manufacturing quality of indian original eqipments manufacturers are not upto the mark and simply declare them unfit for usage. Aerospace giants like UTC aerospace systems, GE, Rolls-Royce etc. try to play safe when it comes to critical parts.&nbsp;<br>ISRO has been following a Zero-defect delivery programme, initiated in 2012 by its chairman. They have tried to implement it in a ground-up fashion and they have involved the technicians, the technical assistants and engineers to the top most levels. Directorate of Systems Reliability &amp; Quality (DSRQ) acts as a nodal agency and extends technical advices and support to ISRO and helps them in maintaining the required quality standards for its mission critical components. Few standards are defined and each process has to go through them to be given a green signal.&nbsp;<br>1. &nbsp;Reliability management practices: Under this, they focus on reviews at different stages(conceptual to post-flight)<br>2.&nbsp;Parts and material monitoring: wide range of tests is carried and the materials are stored under controlled environment. Special consideration is given to environmental impacts of materials and chemicals being used.&nbsp;<br>3. &nbsp;Software Quality standards are strictly followed.&nbsp;<br>But what happens to the parts that have been outsourced to the vendors in the local industrial areas? ISRO, as an organization has worked to help its vendors standardize the processes. Also, the scientists from ISRO remain in constant touch with the vendors during the design development and manufacturing of the components hand share the technologies, the best practices and guide them in order to guarantee the required quality. After working for ISRO for different projects many of these SMEs have evolved in such a great way that they have turned into exporters and are being respected world-wide for their products.&nbsp;<br>Thus, focusing on maintaining global quality standards, along with the need to spend less thus developing indigenous technologies and Indian SMEs as partners and consistently helping them to improve their technologies has helped ISRO maintain its quality standards. More details can be found at&nbsp;<a href=\"http://www.corelogs.com/forum/what-quality-standards-does-isro-follow-for-its-space-missions/It%20is%20well%20known%20that%20the%20aerospace%20industry%20needs%20to%20follow%20a%20much%20higher%20quality%20standard%20when%20it%20comes%20to%20manufacturing%20components%20of%20the%20aircraft%20and%20space%20shuttles.%20When%20it%20comes%20to%20ISRO%E2%80%99s%20missions%20like%20MOM%20etc,%20it%20becomes%20even%20more%20important.%20In%20the%20aerospace%20industry,%20it%20is%20widely%20accepted%20that%20the%20manufacturing%20quality%20of%20indian%20original%20eqipments%20manufacturers%20are%20not%20upto%20the%20mark%20and%20simply%20declare%20them%20unfit%20for%20usage.%20Aerospace%20giants%20like%20UTC%20aerospace%20systems,%20GE,%20Rolls-Royce%20etc.%20try%20to%20play%20safe%20when%20it%20comes%20to%20critical%20parts.%20%20ISRO%20has%20been%20following%20a%20Zero-defect%20delivery%20programme,%20initiated%20in%202012%20by%20its%20chairman.%20They%20have%20tried%20to%20implement%20it%20in%20a%20ground-up%20fashion%20and%20they%20have%20involved%20the%20technicians,%20the%20technical%20assistants%20and%20engineers%20to%20the%20top%20most%20levels.%20Directorate%20of%20Systems%20Reliability%20&amp;%20Quality%20(DSRQ)%20acts%20as%20a%20nodal%20agency%20and%20extends%20technical%20advices%20and%20support%20to%20ISRO%20and%20helps%20them%20in%20maintaining%20the%20required%20quality%20standards%20for%20its%20mission%20critical%20components.%20Few%20standards%20are%20defined%20and%20each%20process%20has%20to%20go%20through%20them%20to%20be%20given%20a%20green%20signal.%201.Reliability%20management%20practices:%20Under%20this,%20they%20focus%20on%20reviews%20at%20different%20stages(conceptual%20to%20post-flight)%202.Parts%20and%20material%20monitoring:%20wide%20range%20of%20tests%20is%20carried%20and%20the%20materials%20are%20stored%20under%20controlled%20environment.%20Special%20consideration%20is%20given%20to%20environmental%20impacts%20of%20materials%20and%20chemicals%20being%20used.%203.Software%20Quality%20standards%20are%20strictly%20followed.%20But%20what%20happens%20to%20the%20parts%20that%20have%20been%20outsourced%20to%20the%20vendors%20in%20the%20local%20industrial%20areas?%20ISRO,%20as%20an%20organization%20has%20worked%20to%20help%20its%20vendors%20standardize%20the%20processes.%20Also,%20the%20scientists%20from%20ISRO%20remain%20in%20constant%20touch%20with%20the%20vendors%20during%20the%20design%20development%20and%20manufacturing%20of%20the%20components%20hand%20share%20the%20technologies,%20the%20best%20practices%20and%20guide%20them%20in%20order%20to%20guarantee%20the%20required%20quality.%20After%20working%20for%20ISRO%20for%20different%20projects%20many%20of%20these%20SMEs%20have%20evolved%20in%20such%20a%20great%20way%20that%20they%20have%20turned%20into%20exporters%20and%20are%20being%20respected%20world-wide%20for%20their%20products.%20Thus,%20focusing%20on%20maintaining%20global%20quality%20standards,%20along%20with%20the%20need%20to%20spend%20less%20thus%20developing%20indigenous%20technologies%20and%20Indian%20SMEs%20as%20partners%20and%20consistently%20helping%20them%20to%20improve%20their%20technologies%20has%20helped%20ISRO%20maintain%20its%20quality%20standards.%20More%20details%20can%20be%20found%20at%20http://www.sac.gov.in/SACSITE/TTIDWebsite/publication/media/article/Quality_Mgmt_%20ISRO_Experience.pdf\">this link</a>','pramanik-has-started-working-in-corelogs','2015-06-13 19:15:06','04:54:52',0,0,1,0,1,1),(6,0,'','F',NULL,'Tata Consultancy Services is now in the network, have a look at its profile.','tata-consultancy-services-is-now-in-the-network-have-a-look-at-its-profile','2015-06-13 20:02:26','04:54:52',0,0,1,0,1,1),(7,0,'','F',NULL,'Pramanik has started working in Tata Consultancy Services.','pramanik-has-started-working-in-tata-consultancy-services','2015-06-13 20:02:40','04:54:52',0,0,1,0,1,1),(8,0,'','F',NULL,'arvind has started working in CoreLogs.','arvind-has-started-working-in-corelogs','2015-06-13 22:23:02','04:54:52',0,0,1,0,1,1),(9,0,'','F',NULL,'Hero MotoCorp is now in the network, have a look at its profile.','hero-motocorp-is-now-in-the-network-have-a-look-at-its-profile','2015-06-14 03:39:31','04:54:52',0,0,1,0,1,1),(10,0,'','F',NULL,'shubham_sagar has started working in Hero MotoCorp.','shubham_sagar-has-started-working-in-hero-motocorp','2015-06-14 03:48:29','04:54:52',0,0,1,0,1,1),(11,0,'','F',NULL,'Tata Steel Ltd. is now in the network, have a look at its profile.','tata-steel-ltd-is-now-in-the-network-have-a-look-at-its-profile','2015-06-14 04:43:01','04:54:52',0,0,1,0,1,1),(12,0,'','F',NULL,'udit has started working in Tata Steel Ltd..','udit-has-started-working-in-tata-steel-ltd','2015-06-14 04:43:18','04:54:52',0,0,1,0,1,1),(13,0,'','F',NULL,'verma.udit has started working in Tata Steel Ltd..','vermaudit-has-started-working-in-tata-steel-ltd','2015-06-14 05:04:31','04:54:52',0,0,1,0,1,1),(14,0,'','F',NULL,'Honda R&D is now in the network, have a look at its profile.','honda-rd-is-now-in-the-network-have-a-look