le.','exide-industries-is-now-in-the-network-have-a-look-at-its-profile','2015-06-21 17:43:56','04:54:51',0,0,1,0,1,1),(44,0,'','F',NULL,'prashant has started working in Exide Industries.','prashant-has-started-working-in-exide-industries','2015-06-21 17:44:17','04:54:51',0,0,1,0,1,1),(45,0,'','F',NULL,'Self Employed is now in the network, have a look at its profile.','self-employed-is-now-in-the-network-have-a-look-at-its-profile','2015-06-21 18:22:58','04:54:51',0,0,1,0,1,1),(46,0,'','F',NULL,'anurag has started working in Self Employed.','anurag-has-started-working-in-self-employed','2015-06-21 18:23:02','04:54:51',0,0,1,0,1,1),(47,0,'','F',NULL,'JSW Dolvi is now in the network, have a look at its profile.','jsw-dolvi-is-now-in-the-network-have-a-look-at-its-profile','2015-06-22 03:29:47','04:54:51',0,0,1,0,1,1),(48,0,'','F',NULL,'ankur has started working in JSW Dolvi.','ankur-has-started-working-in-jsw-dolvi','2015-06-22 03:30:09','04:54:51',0,0,1,0,1,1),(49,1,'','A','Make In India in Manufacturing','&nbsp;Make in India Launched by Prime minister Narendra Modi Targets 25 Sectors including, Automobile, IT, Chemical, Pharmaceutical , tourism, railway, auto component, minning, Renewable energy etc. Out of these core sector is one of most difficult to implement. Unlike tourism, Pharmaceutical and IT, India does not enjoy competitive advantage in core technology and skills to match World class quality in manufacturing. Competing with country like USA, China, Japan, Germany etc. , India is Far behind both in Quality and Quantity in manufacturing Sector. Industrial Development in India has not taken place at the pace it should have been.&nbsp;Nehruian Economy,in the past, has given stress in development of Industries.Industrial Development under umbrella of Five year plan were aimed in making Self sufficient India. The role of developing Industries was given to Public sector units. PSUs noncompetitive attitude and lack of push by government has lead to failure of PSUs. Although many &nbsp;PSU like ONGC, BHEL, SAIL have made huge profit. But overall they have failed in driving a Industrial revolution in India. Steel, Minning, cement, Coal and Petroleum sector have been leading Indian Industrial Growth. And Government companies have also Done well in these sectors. Industries like cottage, Leather, Handicraft, Chemical, and other small consumable goods like bangles, Matchsticks, Crackers etc &nbsp;are still unorganized. Though they give &nbsp;employment large portion of unskilled population. But condition of people working is far from good. With boon in Automobile sector in India, many Industrial sectors have developed India. Which further led to development of Small scale industries supporting Automobile sector. Privatization have lead to Growth in Industrial sector to little extent. But still India hold poor rank in manufacturing.&nbsp; &nbsp;IT has been a lucrative sector for youths and start ups. IT Start ups require less money, Infrastructure and manpower, has stolen Share of manufacturing sectors in start ups and talent. Corruption, Lack of support from government, Money and Infrastructure have made job tough for Manufacturer in India. Shifting of TATA Nano plant in West Bengal is a Example that how hard it is for Industrialist in India. Tackling Land dispute has become part of almost every industrial projects in India. Political parties keep on looking for these kind of issues for their political gain. Rights of farmer, Tribal and locals have kept industries away. But still farmers are Dying , Tribal are starving and locals are waiting for opportunities. Lack of Political will by state government and Cheap politics by oppositions have damaged core sector more than any thing else.India is one of biggest market in mobile and smart phones but still Indian players like Karbon, Micromax produce \'made in China\' products.&nbsp;Now Governments an center have kept growth in manufacturing as its core Agenda. Program like Make in India, Vibrant Gujarat, Make in Maharashtra are increasing Investor confidence in India. But just poster &nbsp;a scheme will not help. Ground Reality need to be change. Things need to be made Easier for Industrialist with more encouragement to Small scale industries. Unorganized sector should be organised in form of Industrial corridors. India has biggest man power looking for opportunity. India have it all Land, Manpower, Raw material and Market to support Industries. Only a Positive environment need to be created. Corruption and disputes should be reduced to minimum, if they cant be eliminated. Only Inviting Industry will not help. Things should be made more easy and profitable for them.','make-in-india-in-manufacturing','2015-06-22 04:28:27','02:29:40',0,15,1,0,1,22),(50,0,'','F',NULL,'Sail is now in the network, have a look at its profile.','sail-is-now-in-the-network-have-a-look-at-its-profile','2015-06-22 06:23:58','04:54:51',0,0,1,0,1,1),(51,0,'','F',NULL,'Sohail.nitjsr has started working in Sail.','sohailnitjsr-has-started-working-in-sail','2015-06-22 06:24:04','04:54:51',0,0,1,0,1,1),(52,0,'','F',NULL,'omji has started working in Tata Steel Ltd..','omji-has-started-working-in-tata-steel-ltd','2015-06-22 14:34:43','04:54:51',0,0,1,0,1,1),(53,0,'','F',NULL,'Maruti Suzuki India Limited is now in the network, have a look at its profile.','maruti-suzuki-india-limited-is-now-in-the-network-have-a-look-at-its-profile','2015-06-22 14:35:11','04:54:51',0,0,1,0,1,1),(54,0,'','F',NULL,'Shanky300 has started working in Maruti Suzuki India Limited.','shanky300-has-started-working-in-maruti-suzuki-india-limited','2015-06-22 14:36:15','04:54:51',0,0,1,0,1,1),(55,0,'','F',NULL,'rohit has started working in Tata Consultancy Services.','rohit-has-started-working-in-tata-consultancy-services','2015-06-22 16:34:22','04:54:51',0,0,1,0,1,1),(56,0,'','F',NULL,'abhimanyu has started working in Tata Steel Ltd..','abhimanyu-has-started-working-in-tata-steel-ltd','2015-06-22 17:20:13'