sultancy Services.','abhimanew-has-started-working-in-tata-consultancy-services','2015-06-23 17:18:36','04:54:50',0,0,1,0,1,1),(68,0,'','A','The Tragedy of the Core Segment Of Engineering','There was a time when the Engineering word indicated the core segment. Well, that time is long gone. These days, the world is all about Software, Apps, Data Analytics, and the likes. Sometimes it seems that the core segment of engineering is losing the race against the IT focused segment in terms of disruptive innovations and development.<br>During the mid 90s, the world saw the WWW revolution. The focus started&nbsp;shifting from the automobiles to pieces of electronic items, from the design of bridges and buildings to design of websites and so on. The number of people using computer, internet and web based services started to grow. However, the community remained confined to specific segment of users who were enthusiastic about internet and its potential to change the world. Many web based communities started to develop out of which most were based on the coders\' communities.Mechanical Engineers were quite untouched to these changes. Actually the only people in the core segment who were related to this boom were the people relating to CAD/CAM/CAE.&nbsp;<br><br>Then came Web2.0. This actually shifted the span of internet and web based services from that small segment of people to the multitude. With the expansion of facebook, linkedin and the likes, common man(even the core segment people) started using internet. But the use has more or less remained confined to using these common platforms only. When the coders were starting to post their problems on stackoverflow, the mechanical engineers could only make Facebook groups and communities which almost never generated any value adding content and no problems were ever solved on those communities. When the coders were working on open source projects and working to spread knowledge, the core segment was still busy in keeping their technologies&nbsp;a secret. <b>When the coders started using free operating systems like Linux and version control systems like Git, the mechanical engineers were still using highly priced CAD and PLM software packages like Catia and Teamcenter.&nbsp;</b><br><br>So, what went wrong and what was the effect. Well, nobody can tell what is the effect of all this as nobody has an idea as to what would have been the&nbsp;condition of the core segment, had these change hit them in a common way. The SMEs are the worst hit in this case. Their growth and development have been severely hampered due to lack of access to advanced technologies at affordable prices. Life of an SME would have been easier if they could use these CAD and PLM packages at affordable prices or for free. The development would have taken a much higher pace if they could avail the services of consultants for free and discuss and share problems and solution globally.<br><br><i>If you still have confusions, just imagine how many startups would have been created and succeeded only if they had to pay some $20,000 for using MySQL or any DBMS and $50,000 for using python or java on day zero. This is the real condition of Small and Medium scale industries in the core segment and they don\'t even know about it.</i><br>We have created&nbsp;<a href=\"http://www.corelogs.com/\" rel=\"nofollow\" target=\"_blank\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(150, 153, 156); font-variant: inherit; line-height: inherit;\">CoreLogs</a>&nbsp;to solve these problems for the Core segment and create a collaborative environment for the SMEs where they can connect with the large scale industries.','the-tragedy-of-the-core-segment-of-engineering','2015-06-23 20:43:41','02:29:40',0,16,1,0,1,1),(69,0,'','F',NULL,'shekharsitanshu has started working in Maruti Suzuki India Limited.','shekharsitanshu-has-started-working-in-maruti-suzuki-india-limited','2015-06-24 06:33:54','04:54:50',0,0,1,0,1,1),(70,0,'','F',NULL,'rohit2 has started working in Tata Consultancy Services.','rohit2-has-started-working-in-tata-consultancy-services','2015-06-24 19:49:12','04:54:50',0,0,1,0,1,1),(71,0,'','F',NULL,'btpl is now in the network, have a look at its profile.','btpl-is-now-in-the-network-have-a-look-at-its-profile','2015-06-24 20:35:37','04:54:50',0,0,1,0,1,1),(72,0,'','F',NULL,'ujjwal has started working in btpl.','ujjwal-has-started-working-in-btpl','2015-06-24 20:35:44','04:54:50',0,0,1,0,1,1),(73,0,'','F',NULL,'sushant has started working in Tata Consultancy Services.','sushant-has-started-working-in-tata-consultancy-services','2015-06-25 07:34:33','04:54:50',0,0,1,0,1,1),(74,0,'','F',NULL,'Santosh has started working in Self Employed.','santosh-has-started-working-in-self-employed','2015-06-25 10:24:12','04:54:50',0,0,1,0,1,1),(75,0,'','F',NULL,'Afsar269 has started working in Tata Consultancy Services.','afsar269-has-started-working-in-tata-consultancy-services','2015-06-25 12:26:48','04:54:50',0,0,1,0,1,1),(76,0,'','F',NULL,'mayur has started working in TATA Motors Ltd.','mayur-has-started-working-in-tata-motors-ltd','2015-06-25 15:22:13','04:54:50',0,0,1,0,1,1),(77,0,'','F',NULL,'Team Drift is now in the network, have a look at its profile.','team-drift-is-now-in-the-network-have-a-look-at-its-profile','2015-06-25 16:52:32','04:54:50',0,0,1,0,1,1),(78,0,'','F',NULL,'surya has started working in Team Drift.','surya-has-started-working-in-team-drift','2015-06-25 16:52:39','04:54:50',0,0,1,0,1,1),(79,0,'','F',NULL,'surya has started working in Team Daksh.','surya-has-started-working-in-team-daksh','2015-06-25 17:11:23','04:54:50',0,0,1,0,1,1),(80,0,'','F',NULL,'satish has started working in Tata Hitachi Construction Machinery Co. Pvt. Ltd..','satish-has-started-working-in-tata-hitachi-construction-machinery-co-pvt-ltd','2015-06-25 17:12:43','04:54:50',0,0,1,0,1,1),(81,0,'C','F',NULL,'Hey friends, C