ns as compared to car2 even if they belong to the same\r\nmodels. This was more or less condition of all the industries back then.</i> There\r\nwas no concept of large scale manufacturing anywhere in any industry. <b>Henry\r\nford introduced the concept of large scale manufacturing and mass production.</b>\r\nComponents started to become identical and replaceable. This gave a boom to\r\nautomobile manufacturing, reduced the cost and made automobile a commodity of\r\ncommon use making life easier. But this was not the only effect. The concept of\r\nmass manufacturing was introduced to all segments of industry and it was one\r\nbig thing.<br>After that came\r\nthe phase of automation and moving assembly lines. Again it was introduced in\r\nAutomobile sector by the same legendary Henry Ford. This reduced the production\r\ntime of cars, ensured better use of workforce and specialization of task. Again\r\nthis was a big concept and was embraced by all types of industry from textile\r\nmills to food processing, everything started to get automated. <u>This caused a\r\nhuge jump in production of goods along with a hell lot of other things, the\r\ngreat depression being one of them.\r\n\r\nIt was the\r\nautomobile industry which was changing the world of manufacturing from inside.</u><br><b>&nbsp;At this point of time, Alfred Sloan of General motors introduced the concept of\r\nstandardization of components and dedicated tools for production.</b> This seems a\r\nvery common thing now but at that time it was a ground breaking concept and\r\nbrought hard automation to epic level. Again this concept was used by all other\r\nindustries. After this there were a few decades when all automobile company\r\nworked on reducing the production time, idle time, cost involved in production\r\nand new ways were devised to manage the workforce and all these were followed\r\nby the whole manufacturing segment. The automobile industry was setting the\r\npace of development of world and shift of power. The work of Ford and Sloan\r\nshifted the power and industrial dominance from Europe to USA.<b>&nbsp;</b><b><br></b><b>But after the\r\nworld war 2, the Japanese automobile industry began to grow significantly. They\r\nintroduced the concept of Lean manufacturing and Kaizen to the industry which\r\nlead to the creation of a whole new era in automobile manufacturing which\r\nultimately propagated to all other industries and took the world with surprise.\r\n</b>It was complete shift from hard automation to flexible automation, increasing\r\ninventory to decreasing it, large batches to small batches. They prophesized\r\nthat the ideal batch size should be 1. This was a complete disruption, and\r\nhelped them to reduce cost, increased control over quality, and ability to meet\r\nthe changing consumer demands instantly leading to increased number of models\r\nbeing introduced. The US automobile industry succumbed and Japanese captured\r\nthe automobile market.&nbsp;<br>But lean was\r\nnot just limited to automobile industry as every other thing. It instantly was\r\nadopted by the whole world and every industry. It shifted the dominance from\r\nUSA to Japan and Korea from which USA could never recover. The state of\r\nautomobile industry forced all other industries to work on quality improvement,\r\nsafety, better products at lesser costs and production based on consumer demands.&nbsp;<b>The automobile\r\nindustry has been the trend setter for one whole century and that’s why they\r\ncall it the machine that changed the world. Period.</b>','automobile-the-machine-that-changed-the-world','2015-06-30 07:02:09','02:29:39',0,9,1,0,1,2),(123,0,'','F',NULL,'DilipKumar has started working in Nit Jamshedpur.','dilipkumar-has-started-working-in-nit-jamshedpur','2015-06-30 08:08:49','04:54:49',0,0,1,0,1,1),(124,0,'','F',NULL,'Team Saksham International is now in the network, have a look at its profile.','team-saksham-international-is-now-in-the-network-have-a-look-at-its-