','04:54:40',0,0,1,0,1,1),(453,0,'','F',NULL,'amit2 has started working in Nit trichy .','amit2-has-started-working-in-nit-trichy','2015-08-01 13:21:04','04:54:40',0,0,1,0,1,1),(454,0,'','F',NULL,'INPG, Germany is now in the network, have a look at its profile.','inpg-germany-is-now-in-the-network-have-a-look-at-its-profile','2015-08-01 15:39:54','04:54:40',0,0,1,0,1,1),(455,0,'','F',NULL,'GerryS has started working in INPG, Germany.','gerrys-has-started-working-in-inpg-germany','2015-08-01 15:40:02','04:54:40',0,0,1,0,1,1),(456,0,'','F',NULL,'Krishan212 has started working in lovely.','krishan212-has-started-working-in-lovely','2015-08-02 04:37:44','04:54:40',0,0,1,0,1,1),(457,0,'','F',NULL,'pramanik2 has started working in Tata Consultancy Services.','pramanik2-has-started-working-in-tata-consultancy-services','2015-08-02 05:27:55','04:54:40',0,0,1,0,1,1),(458,0,'A','F',NULL,'Looks like a great platform for crowd-sourcing questions and problems as I see participation from people working in different fields on a single platform..!!','looks-like-a-great-platform-for-crowd-sourcing-questions-and-problems-as-i-see-participation-from-people-working-in-different-fields-on-a-single-platform','2015-08-02 05:53:07','11:45:22',0,3,1,0,1,366),(459,0,'','F',NULL,'IIT-BHU is now in the network, have a look at its profile.','iit-bhu-is-now-in-the-network-have-a-look-at-its-profile','2015-08-02 06:01:26','04:54:40',0,0,1,0,1,1),(460,0,'','F',NULL,'rohit4 has started working in IIT-BHU.','rohit4-has-started-working-in-iit-bhu','2015-08-02 06:01:44','04:54:40',0,0,1,0,1,1),(461,0,'','A','How Product Lifecycle Management and Supply  Chain Management has come close to give a new spark to business ','&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The quest for faster product development, better\r\nresource utilization and stronger market presence is not new to the\r\nmanufacturing industries. A last few decades have witnessed accelerated\r\ntechnological improvements irrespective of the field of application. Right from\r\nthe post-World War II era the enterprises have been evolving in new ways to\r\nincrease efficiency in all the processes including manufacturing operations and\r\nsales. With new strategic developments like introduction of product lifecycle\r\nmanagement (PLM) and an established supply chain management (SCM), the\r\norganizations have witnessed a whole new horizon of performance. Now when we\r\nare well into the digital age, the enterprises are not hesitating to exploit\r\nits benefits to boost their revenues. It started with computer aided designing\r\nand now the world is looking towards a complete digital enterprise where all\r\nthe major processes are being carried out through software, may it PLM, SCM,\r\ncustomer relationship management (CRM) or the whole enterprise resource planning\r\n(ERP). Digitalization has also developed a platform where collaboration of\r\ndifferent pillars of an enterprise can be more simplified and put to practical\r\napplication in the best possible way.&nbsp;<br><br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; It has been seen that automotive and high-tech\r\nelectronics companies have in some way or the other collaborated their PLM and\r\nSCM locally and globally to revive their presence by making products not just\r\nwith higher value but also suitable for the needs of the different consumers\r\nand setting new benchmarks in the associated timelines of product introduction.\r\nNow other enterprises are following the same mantra and making it work every\r\ntime successfully.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; PLM was introduced with a vision to make enterprises\r\nmore responsive to the changing market trends and meeting customer\r\nexpectations. It helped companies reduce product development time and time to\r\nmarket. As the complexity of the functioning of manufacturing giants increased\r\nas a result of involvement of more number of suppliers and more technically\r\nadvanced products, PLM played a major role in maintaining the right harmonics\r\nto yield best results.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SCM came as\r\na tool to enhance the capability of the enterprise to put right product in\r\nfront of the right customers at the right time to maximize the benefits. Though\r\nit has existed for a long time but a proper structure gained importance when\r\nthe demand became more diverse and affected by demographic and geographic\r\nfactors. \r\n\r\nThe new trends now focuses on how effectively both\r\ncan be merged together to reap the best results and make them work seamlessly\r\ntowards the common goal. &nbsp;&nbsp;<br>&nbsp; &nbsp; &nbsp;<b> &nbsp;Why the closeness is needed?&nbsp;</b>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The scenario of product development has changed in\r\nthis era as concurrent engineering has taken over the engineering workflow. Now\r\nthe suppliers are being made ready to provide raw materials and the production\r\nengineer starts finalizing the design of tools and dies even when the final\r\ndesign is not ready. More and more processes are being outsourced, more\r\nsuppliers are being involved in the pre-production phases and more specific\r\nproducts are being introduced for the demands of different geographies.\r\nManaging the agile product lifecycle without a strong supply chain network has\r\nbecome impossible. For removing the inefficiencies within the system a lot of\r\nprocesses from both PLM and SCM are being fused together and the presence of\r\ndigital platforms has made this fusion perform better. The software players are\r\ntoday offering products with features consolidated from both PLM and SCM as\r\nthis interrelation had been envisaged quite before. Now let’s go through the\r\nimportant factors that have paved the way for such interrelation.<br>&nbsp; &nbsp; &nbsp; &nbsp;§&nbsp; <b>New\r\nstrategy and structure of the enterprise</b>:&nbsp;It has become common for the manufacturing\r\ngiants to establish their designing and manufacturing facilities at different\r\nlocation across the globe as a part of the new strategy. Not only more number\r\nof suppliers is being added at different tiers but also their involvement in\r\nproduct design and delivery has been increased. This has increased the\r\nefficiency of the companies and at the same time increased the complexity of\r\nthe process. &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; To ensure proper visibility across the\r\nworkflow digitalization of the processes have become unavoidable. Instead of\r\noffering a platform to be used just within the core enterprise to manage\r\nworkflows, different PLM software today are offering solutions to connect the suppliers\r\nalso to realize the correct effectiveness fully . SCM offerings are also getting\r\naligned to achieve the common goal of removing the inefficiencies. The\r\nsuppliers, core enterprise and the retailers are coordinating closely to help products\r\nreach customer in time. The fine boundaries between segmented PLM and SCM are\r\nbeing diffused to channelize all&nbsp;&nbsp; &nbsp;available resources towards realizing a\r\nperfect end to end flow of goods and information. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; In the time when a manufacturing giant\r\ndesigns a product In the US in coordination with offshore development centers\r\nin India, manufactures and assembles in China and sells all over the globe, the\r\ncomplete merger of the various supply chains throughout the lifecycle of the\r\nproduct is what being demonstrated. &nbsp;&nbsp;&nbsp; &nbsp;<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; §&nbsp; <b style=\"line-height: 1.42857143;\">Global\r\nPresence:</b> The companies are never founded to offer products and services just\r\nlocally. They always thrive to expand and go global. To achieve global presence\r\nthey have to meet different demands in different economies following different\r\ntaxation rules solving different logistic problems and different compliance\r\nissues etc. All these issues combines with all the different product they offer\r\nto make it a big challenge to overcome both in product lifecycle and the supply\r\nchains. &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;The demand for different products\r\nwhich meet all the local issues in different part of the world has left no\r\nother option than involving the supply chains fully into product development.\r\nThe companies now customize all their product development workflow with the\r\nlocally established supply chains to meet customer demand in different areas.\r\nThis also calls for better integration of the supply base along with a need of building\r\nmore intense and inclusive relationships with suppliers where more design and\r\nmanufacturing plans are shared. Also involving suppliers and vendors in\r\ndifferent PLM phases help them make the product more aligned with customer\r\ndemands even when the CRM is not either established or fully functional.&nbsp;<br><br>&nbsp; &nbsp; &nbsp; §&nbsp; <b>Building\r\nResilience:</b> Organizations today are giving more attention towards building a workflow\r\nwhich has the immunity to fluctuating demand, uncertain economic conditions, ever\r\ngrowing competition and even physical and infrastructural damages. To develop\r\nand place products according to quick changing trends over different markets is\r\nthe key to sustain a continuous growth. It has been seen that even giving read\r\nonly access of digitalized PLM platforms to the suppliers has helped in keeping\r\nthem updated about the new design changes being planned and reducing the time\r\ntaken by them to be ready to implement those changes in the new batches of the\r\nproducts being rolled out. Moreover thorough integration of PLM and SCM can\r\nmake key manufacturing aspects of Just in Time (JIT) become easy to adapt over\r\nthe whole process and can align the timelines of different suppliers and\r\nretailers with the core enterprise. \r\n\r\n&nbsp;&nbsp;<br><br>&nbsp; <b>Why it was so obvious?</b>&nbsp;<br><br>&nbsp;The concepts and structure of product lifecycle\r\nmanagement and supply chain management are well established now. Software\r\nplatforms have brought PLM and SCM to new horizons where they are working on\r\nfully optimized levels. But the scenario seemed to be stagnated and saturated\r\nwith the individual best efforts of the two. To further improvise the performance,\r\nthe need to collaborate two important division of an enterprise was the obvious\r\nsolution. This situation finally gives the obvious option of starting the\r\nintegration of the two most important and well established pillars of the\r\nenterprise, those being PLM and SCM. It is a step closer to an all functional\r\ngroup integrated, extended ERP which is the necessity before we move into the\r\n‘Industrial Internet of Things’ world.&nbsp;<br>&nbsp;\r\n\r\n \r\n<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\nEnterprises have also recognized the fact that the size of the suppliers\r\nhave increased ,&nbsp; not only in volume of\r\nproduction but also in number of core enterprises they work with and the number\r\nof intellectual property rights they share with those companies. The suppliers\r\nand retailers today have sometimes more experience than the core companies in\r\nspecific fields owing to their exposure of working with different client and\r\nhence companies are seeking inclusive participation from those elements of the\r\nsupply chain and breaking the barriers to accelerate growth. &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; The availability of numerous offerings by\r\nsoftware vendors both in PLM and SCM has also enabled the enterprises to have a\r\nbetter visibility over the whole process of PLM and SCM. The PLM software\r\nvendors are offering different solutions which include control over the amount\r\nof data shared by the core enterprises with the suppliers and retailers. Similarly\r\nintroduction of RFID and barcode enabled supply chain tracking have gained\r\nrelevance as it can be integrated easily with the regular SCM software\r\nofferings.&nbsp; &nbsp; &nbsp; &nbsp; Furthermore the core enterprise today is including\r\nsuppliers in their key processes, sharing risks and rewards and making them\r\npartners in their profit and loss which is being possible by making PLM and SCM\r\nwork closely. The companies are not just focusing solely on their vertical\r\ngrowth but also extending the growth horizontally among suppliers and retailers\r\nby making all the actual participant in growth perform better and thrive for\r\nsuccess with the same spirit as the core enterprise.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; These factors together are fueling the growing\r\ninter relation which will not just stop here but change the whole perspective\r\nof building a digital enterprise as organizations will invest more as&nbsp; they will try to harness more profit out of\r\nthis revolution and get high returns on their investments. &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp;&nbsp;\r\n\r\n<b>Whats is next thing we are looking at ?</b><b><br></b>&nbsp;&nbsp;\r\n\r\nThe extended enterprise resource planning which will\r\nbreak the functional silos and remove the boundaries to mold it into one system\r\nwhich will give complete end to end visibility of the whole process. Moreover\r\nbuilding the whole system into cloud will help in collecting smart data and\r\nutilizing it for increasing the productivity. It will help build a system where\r\nan end customer picking up a product from a retailer will decide the quality,\r\nquantity and time of procurement of the raw material at some tier 2 or 3\r\nsupplier. A leading retail chain has made its customer and supplier data\r\ncollected for over 2 years online, to increase its sales.&nbsp;&nbsp;\r\n\r\n\r\n \r\n<br>&nbsp; &nbsp; This unified all functional division integrated\r\nextended enterprise will actually make the organization ready for industry 4.0\r\nand Industrial internet of things era. The growing interrelation is not just an\r\noption but a compulsory pre-requisite for stepping fully into new world of\r\nconnected devices and products. Actually the enterprise which can establish\r\nthis kind of infrastructure stands a chance to rise above all market\r\ncompetitions and set benchmarks which will be absolute as the best available\r\ncombination of resources available on globe will be used through big data\r\nanalytics running over the completely consolidated ERP. The famous Just-in-Time\r\nwill step down to make way for <b>Just-in-Real-Time</b>. So organizations should start\r\nconsidering putting all its process into one single digital platform to get\r\nmaximum returns for every dollar they invest.<br><br><b>Images have been used from Gartner reports and google images.</b>','how-product-lifecycle-management-and-supply-chain-management-has-come-close-to-give-a-new-spark-to-business','2015-08-02 06:29:01','02:29:39',0,11,1,0,1,366),(462,0,'','F',NULL,'sree has started working in ME - Mechanical Engineering.','sree-has-started-working-in-me-mechanical-engineering','2015-08-02 10:22:29','04:54:40',0,0,1,0,1,1),(463,0,'','F',NULL,'Cairo university is now in the network, have a look at its profile.','cairo-university-is-now-in-the-network-have-a-look-at-its-profile','2015-08-02 10:52:30','04:54:40',0,0,1,0,1,1),(464,0,'','F',NULL,'abdalla has started working in Cairo university.','abdalla-has-started-working-in-cairo-university','2015-08-02 10:52:35','04:54:40',0,0,1,0,1,1),(465,0,'','F',NULL,'itihas has started working in Indian Institute of Technology, Delhi.','itihas-has-started-working-in-indian-institute-of-technology-delhi','2015-08-02 13:43:35',